INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('c9656172', 15030041, 'PERBANDINGAN METODE PROFILE MATCHING DAN WEIGHTED PRODUCT DALAM PENENTUAN CALON PENGAJAR SEKOLAH LUAR BIASA (SLB) BERBASIS WEBSITE (Studi Kasus SLB Pamardi Putra Yogyakarta)', 'PERBANDINGAN METODE PROFILE MATCHING DAN WEIGHTED PRODUCT DALAM PENENTUAN CALON PENGAJAR SEKOLAH LUAR BIASA (SLB) BERBASIS WEBSITE (Studi Kasus SLB Pamardi Putra Yogyakarta) Oleh Dian Fitasari Duru 1503004 ABSTRAK Pada penelitian ini penulis akan membahas tentang perancangan dan penerapan perangkat lunak berbasis website untuk penentuan calon pengajar pada sekolah luar biasa, dimana pada instansi ini menanggani anak-anak berkebutuhan khusus sehingga dibutuhkan pengajar yang sesuai untuk anak-anak tersebut, penentuan calon pengajar harus dilakukan menggunakan sistem penyeleksian yang efektif dan akurat dengan memiliki kriteria sesuai dengan kebutuhkan. Untuk mengetahui calon pengajar yang sesuai, peneliti menerapkan sistem pendukung keputusan sebagai proses penentuan dengan menggunakan metode profile matching dan weighted product sebagai tahap perhitungan perbandingan untuk hasil penetuan calon pengajar. Dalam penelitian ini membandingkan metode profile matching dan weighted product untuk menentukan dan memudahkan sistem penyeleksian calon pengajar SLB yang sesuai dengan kriteria diinginkan. Hasil dari penelitian ini, menghasilkan output yang berbeda. Kata Kunci: Perbandingan Metode Sistem Pendukung Keputusan, Profile Matching, Weighted Product, Website', '010209011', '0196305061990032001', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('8115dde2', 15030031, 'PENCARIAN KATA DASAR MENGGUNAKAN METODE PREFIX DAN POSTFIX BERBASIS WEB', 'PENCARIAN KATA DASAR MENGGUNAKAN METODE PREFIX DAN POSTFIX BERBASIS WEB Oleh Desynta Karmila Sari 15030031 INTISARI Kata dasar adalah kata yang belum mengalami penambahan, pengulangan dan penggabungan dengan kata lain. Kata dasar dapat dihasilkan dari sebuah kata berimbuhan dengan cara menghilangkan imbuhan awalan, akhiran atau gabungan awalan dan akhiran. Metode prefix yaitu menghilangkan nol atau lebih simbol karakter dari belakang sedangkan metode postfix yaitu menghilangkan nol atau lebih simbol karakter dari depan. Dalam penelitian ini dibuatlah sebuah aplikasi pencarian kata dasar dengan menggunakan metode prefix dan postfix dengan aplikasi yang dirancang berbasis web, pengujian yang dilakukan yang pertama dengan menggunakan pengujian black box dan hasil yang didapatkan sesuai dengan rancangan yang telah dibuat yaitu tombol pada aplikasi apabila diklik dapat menuju ke halaman yang diinginkan dan kolom pada aplikasi apabila diinputkan, hasil inputan sesuai dengan yang diharapkan. Pengujian yang kedua dengan pengujian fungsional didapatkan keberhasilan sebesar 60,20% dan kegagalan sebesar 39,80%. Pencarian kata dasar dengan menggunakan metode prefix dan postfix cocok digunakan, jika kata berimbuhan berupa kata berawalan, berakhiran, atau berawalan dan berakhiran dengan jumlah huruf yang sama. Kata Kunci: Kata Dasar, Metode Prefix, Metode Postfix', '011611144', '011409116', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('7da2f5bf', 15030032, 'PERANCANGAN SISTEM ABSENSI DALAM PENANGANAN PROSES UJIAN BERBASIS PAPERLESS (Studi Kasus : Sekolah Tinggi Teknologi Adisutjipto)', 'PERANCANGAN SISTEM ABSENSI DALAM PENANGANAN PROSES UJIAN BERBASIS PAPERLESS (STUDI KASUS : SEKOLAH TINGGI TEKNOLOGI ADISUTJIPTO) Oleh Yasifa Yuri Haqli Sukma 15030032 Intisari Sistem absensi ujian yang ada di STT Adisutjipto saat ini masih menggunakan kertas (manual). Konsep paperless bisa diterapkan dalam sistem absensi ujian. Hasil dari tugas akhir ini berupa perancangan sistem absensi dalam penanganan proses ujian berbasis paperless yang memanfaatkan teknologi QR Code dalam upaya mengurangi penggunaan kertas dan mengefisiensi waktu proses absensi ujian. Sistem absensi dibangun menggunakan bahasa pemrograman PHP dan HTML dengan database PostgreSQL. Pengujian sistem absensi dilakukan secara langsung pada saat ujian. Hasil dari pengujian aplikasi diperoleh bahwa aplikasi absensi berbasis paperless lebih cepat 1 menit 15 detik dibandingkan proses absensi manual. Hasil dari pengujian server diperoleh bahwa database aplikasi absensi menggunakan 13,9 % kapasitas CPU, dan aplikasi absensi ujian menggunakan 0,7 % kapasitas CPU. Kata Kunci: QR Code, Sistem Absensi, Paperless', '010409041', '010904068', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('6a731271', 15030053, 'LAYANAN KRIPTOGRAFI DENGAN MENGGUNAKAN BAHASA JAWA WALIKAN PADA HURUF ROMAWI', 'LAYANAN KRIPTOGRAFI DENGAN MENGGUNAKAN BAHASA JAWA WALIKAN PADA HURUF ROMAWI Arief Dwi Nugroho 15030053 INTISARI Penelitian ini bertujuan untuk membangun sebuah web service berupa layanan kriptografi yang menggunakan metode ROT10. Metode ini mengadaptasi dari dua metode yaitu Bahasa Jawa Walikan gaya Yogyakarta dan ROT13 dimana huruf dalam inputan hanya akan bergeser sebanyak 10 (sepuluh) kali dari huruf aslinya (huruf A akan menjadi huruf K, huruf B akan menjadi huruf L dan jika untuk huruf K akan menjadi huruf A begitupun seterusnya). Web service ini yang nantinya terbuat dari bahasa pemrograman python diharapkan dapat diakses menggunakan bahasa permrograman lain secara bebas dan terbuka dengan memanfaatkan sebuah jaringan lokal maupun interlokal. Berdasarkan pengujian aplikasi ini dapat berjalan dengan lancar dengan syarat memiliki server Xampp, browser dan koneksi internet. Namun dalam proses enkripsi dan proses dekripsi pada aplikasi ini terdapat kendala jika menggunakan huruf kapital dan special characters yang tidak terdapat pada program maka proses tidak akan berjalan. Kata Kunci: Bahasa Walikan, Webservice, ROT10
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('466194c5', 15030024, 'MEDIA PEMBELAJARAN KOMPONEN PESAWAT TERBANG TENTANG CARA KERJA TURBOFAN DENGAN SIKLUS IDEAL', 'MEDIA PEMBELAJARAN KOMPONEN PESAWAT TERBANG TENTANG CARA KERJA TURBOFAN DENGAN SIKLUS IDEAL Oleh Geby Nauly Pakpahan 15030024 INTISARI Turbofan adalah salah satu bagian dari pesawat terbang. Dalam pembelajaran komponen pesawat terbang masih terdapat kesulitan untuk mempelajari cara kerja pada turbofan. Pada media pembelajaran ini perubahan tekanan suhu udara di turbofan ditunjukkan dengan adanya perubahan warna, suara dan perputaran mesin. Pada media pembelajaran ini juga menurut siklus ideal gaya thrust sebesar 1 sampai 6 rpm, ini sesuai dengan keadaan engine yang berada di ground yang tidak terpengaruh oleh ketinggian, velocity dan kecepatan suara. Nilai F/mo 5930,794 lbf/(lbm/sec) sama dengan 6rpm. Dalam pembuatan simulasi turbofan terdapat beberapa proses. Proses petama adalah pembuatan modelling turbofan menggunakan Blender. Setelah melakukan proses modelling selanjutnya proses animation menggunakan Unity. Berdasarkan hasil pengujian black box dan white box terhadap simulasi cara kerja gas turbine pada turbofan berbasis desktop dapat disimpulkan bahwa berhasil. Kata kunci : Turbofan, gaya thrust, engine, siklus ideal
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('ef2b17f7', 15030048, 'IMPLEMENTASI SIMPLE ADDITIVE WEIGHTING (SAW) DAN WEIGHTED PRODUCT (WP) DALAM APLIKASI PENCARIAN BIMBEL UNTUK SISWA SMA DI KOTA YOGYAKARTA', 'IMPLEMENTASI SIMPLE ADDITIVE WEIGHTING (SAW) DAN WEIGHTED PRODUCT (WP) DALAM APLIKASI PENCARIAN BIMBEL UNTUK SISWA SMA DI KOTA YOGYAKARTA Oleh Agung Prasetia 15030048 INTISARI Dari hasil observasi di SMA Negeri 9 Yogyakarta dan SMA Negeri 8 Yogyakarta, dapat disimpulkan bahwa prioritas dalam menentukan Bimbel antara lain yaitu biaya, fasilitas, dan jarak ke tempat Bimbel. Penelitian bertujuan untuk membuat aplikasi pencarian Bimbel untuk siswa SMA di Kota Yogyakarta berbasis web, dengan metode WP dan SAW. Agar mempermudah mempertimbangkan pemilihan bimbel. Berdasarkan hasil implementasi pengujian yang telah dilakukan pada tugas akhir ini, maka dapat disimpulkan bahwa, metode SAW dan WP adalah metode yang dapat digunakan dalam pengambilan keputusan pemilihan bimbel. Metode yang lebih relevan digunakan adalah metode SAW dengan nilai perubahan ranking sebesar 2.93%. Kata Kunci : Sistem pendukung Keputusan, WP, SAW, Bimbel', '011611144', '010904068', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('de983a06', 15030045, 'MEDIA PEMBELAJARAN BAHASA ISYARAT INDONESIA UNTUK MENJEMBATANI KOMUNIKASI ANTARA TEMAN DENGAR DAN TEMAN TULI BERBASIS ANDROID', 'MEDIA PEMBELAJARAN BAHASA ISYARAT INDONESIA UNTUK MENJEMBATANI KOMUNIKASI ANTARA TEMAN DENGAR DAN TEMAN TULI BERBASIS ANDROID Chindy Puspita 15030045 INTISARI Bahasa Isyarat Indonesia atau yang dikenal dengan Bisindo digunakan oleh para sesama kaum tuli maupun orang normal bisa disebut juga teman dengar untuk saling berkomunikasi satu sama lain. Pembelajaran bahasa isyarat pada umumnya dilakukan secara langsung dengan saling bertatap muka, dan belum ada sebuah aplikasi yang memadai untuk proses belajar bahasa isyarat. Maka dikembangkanlah suatu aplikasi teman dengar ini untuk membantu belajar bahasa isyarat Indonesia bagi teman dengar maupun teman tuli, dan dapat menghemat waktu dan kuota karena aplikasi ini dapat berjalan secara offline. Dalam pembuatan media pembelajaran bahasa isyarat ini menggunakan behasa pemrograman Java, dan menggunakan database SQLite. Berdasarkan pengujian blackbox menunjukkan aplikasi sudah berjalan sesuai dengan rancangan awal yang dibuat. Berdasarkan pengujian yang diperoleh menggunakan skala Linkert, aplikasi teman dengar memiliki skor pengujian fungsi 91,4% yang diporel dari pengujian kepada teman tuli sebanyak 15 responden dan 88,57% hasil dari pegujian terhadap teman dengar sebanyak 30 responden. Aplikasi ini dapat berjalan di smartphone dengan sistem operasi Android versi 6.0 Marshmallow, 7.0 Nougat, 8.0 Oreo, 9.0 Pie dan 10. Menunjukkan bahwa aplikasi tersebut berjalan dengan lancar, dan dapat di gunakan dengan mudah. Berdasarkan hasil pengujian maka disimpulkan aplikasi teman dengar dapat digunakan sebagai alat bantu belajar bahasa isyarat Indonesia. Kata kunci : Bisindo, Android, Animasi, Bahasa Isyarat', '011210095', '011409116', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('de864daa', 15030001, 'PEMANFAATAN FLAG SECURE UNTUK PROTEKSI BUKU DIGITAL PADA E-LIBRARY SEKOLAH TINGGI TEKNOLOGI ADISUTJIPTO', 'PEMANFAATAN FLAG SECURE UNTUK PROTEKSI BUKU DIGITAL PADA E-LIBRARY SEKOLAH TINGGI TEKNOLOGI ADISUTJIPTO Nandra Putra Aryanto 15030001 INTISARI Penerapan teknologi informasi pada perpustakaan seperti e-library sudah banyak dimanfaatkan untuk mempermudah pekerjaan pustakawan. Tetapi tidak semua perpustakaan menerapkan teknologi informasi yang menyediakan hak akses mandiri bagi para pengunjungnya. Hasil dari tugas akhir ini berupa aplikasi e-library berbasis Android yang di terapkan pada perpustakaan Sekolah Tinggi Teknologi Adisutjipto dengan tujan buku-buku yang ingin dibaca dan dipinjam dapat dibuka menggunakan smartphone. Tujuan dari penelitian ini membuat buku dalam format PDF dapat diakses dan dibaca serta diproteksi agar tidak digandakan tanpa seizin perpustakaan STTA. Agar tujuan dapat tercapai maka metode yang digunakan dalam peneltian ini dalam bentuk perancangan perngkat lunak dengan pemrograman berorientasi obyek. Untuk meningkatkan keamanan pada aplikasi e-library di perpustakaan Sekolah Tinggi Teknologi Adisutjipto, aplikasi yang dibuat juga memanfaatkan library pada Android Studio yang bernama flag secure. Hasil dari pengujian yang dilakukan menyatakan bahwa proteksi file buku pada aplikasi e-library berbasis Android mampu menghalau pengguna melakukan tangkapan layar (screenshot), menyalin file buku, dan pengunduhan file secara ilegal. Sedangkan Kecepatan akses dalam membuka file buku pada aplikasi e-library berbasis Android sangat dipengaruhi oleh kecepatan koneksi dan ukuran file buku. Dari hasil pengujian ini dapat diambil kesimpulan bahwa buku dalam format PDF di E-library pada Perpustakaan STTA dapat diproteksi. Kata Kunci: Flag Secure, Proteksi Buku Digital, E-library', '010303032', '010904068', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('4e907345', 15030033, 'PEMANFAATAN RESTFUL API PADA MOBILE BASED TEST UNTUK SERTIFIKASI KARYAWAN PT. GARUDA MAINTENACE FACILTY AEROASIA TBK', 'PEMANFAATAN RESTFUL API PADA MOBILE BASED TEST UNTUK SERTIFIKASI KARYAWAN PT. GARUDA MAINTENACE FACILTY AEROASIA TBK Satya Wira Wicaksana 15030033 INTISARI Dapat merancang dan membuat aplikasi Mobile Based Test untuk sertifikasi karyawan di PT. Garuda Maintenance Facility dengan memanfaatkan restful API. Untuk membuat aplikasi Mobile Based Test menggunakan 2 framework yaitu Android Studio dan Codeigneter. Android Studio digunakan untuk membuat aplikasi GMFAdmin untuk memonitor tes sertifikasi, sedangkan GMF AeroAsia untuk melakukan tes sertifikasi. Codeigneter digunakan untuk membuat Application Programming Interface (API) untuk media transfer data dari aplikasi ke database yang tersimpan di database. Pengujian Mobile Based Test meliputi pengujian fungsionalitas dan uji Whitebox. Berdasarkan uji fungsionalitas pada aplikasi GMFAdmin menyatakan semua fungsi dan button berjalan sesuai fungsinya, sedangkan pada aplikasi GMF AeroAsia semua fungsi dan button juga berjalan sesuai fungsinya. Pada pengujian menggunakan Whitebox aplikasi GMFAdmin terhadap 3 path selama 3 hari didapatkan tingkat keberhasilan sebesar 100%, sedangkan pengujian Whitebox pada aplikasi GMF AeroAsia terhadap 8 path selama 3 hari didapatkan tingkat keberhasilan sebesar 100%. Kata kunci : Restful, API, Mobile, Test, Sertifikasi', '011611144', '011210095', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('df719d71', 15030013, 'SISTEM PENDUKUNG KEPUTUSAN PRIORITAS PENGAJUAN BEASISWA DIKPORA DIY DAN PPA MENGGUNAKAN METODE MULTI OBJECTIVE OPTIMIZATION ON THE BASIS OF RATIO ANALYSIS (Studi Kasus : Sekolah Tinggi Teknologi Adisutjipto)', 'SISTEM PENDUKUNG KEPUTUSAN PRIORITAS PENGAJUAN BEASISWA DIKPORA DIY DAN PPA MENGGUNAKAN METODE MULTI OBJECTIVE OPTIMIZATION ON THE BASIS OF RATIO ANALYSIS (Studi kasus : Sekolah Tinggi Teknologi Adisutjipto) Sulistyo Nugroho 15030013 INTISARI Penentuan prioritas pengajuan beasiswa Dikpora DIY dan PPA di Sekolah Tinggi Teknologi Adisutjipto masih dilakukan dengan cara manual. Dalam menentukan prioritas pengajuan beasiswa maka perlu membutuhkan kriteria pada setiap beasiswa. Dalam menentukan mahasiswa yang berhak menerima beasiswa tersebut, maka metode Multi Objective On The Basis Of Ratio Analysis merupakan metode yang akan digunakan pada proses penentuan beasiswa Dikpora DIY dan PPA karena metode tersebut merupakan sistem multiobjektif untuk pengoptimalan 2 atau lebih kriteria yang yang saling bertentangan secara bersamaan dengan menerapkan 5 langkah proses perhitungan dari memasukan nilai, membuat matriks keputusan, normalisasi, optimasi dan proses perangkingan diurutkan berdasarkan total nilai MOORA dari yang terbesar. Berdasarkan hasil pengujian dengan menggunakan data pendafar beasiswa Dikpora DIY dan PPA tahun 2019, kesamaan perhitungan sistem pendukung keputusan dengan data kemahasiswaan dalam menentukan kandidat yaitu sebesar 100% pada sistem pendukung keputusan prioritas pengajuan beasiswa Dikpora DIY, sedangkan untuk pengujian pada sistem pendukung keputusan prioritas pengajuan beasiswa PPA didapatkan hasil kesamaan perhitungan sistem pendukung keputusan dengan data kemahasiswaan dalam menentukan kandidat berdasarkan program studi menunjukan kesamaan untuk Teknik Elektro sebesar 100%, Teknik Industri 100%, Informatika 75%, Teknik Mesin 80%, Teknik Dirgantara 50%, dan untuk Aeronautika 50%. Kata Kunci : Prioritas Pengajuan Beasiswa, Sistem Pendukung Keputusan, Dikpora DIY, PPA', '010209011', '011611144', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('21c23944', 15030020, 'SISTEM PENDUKUNG KEPUTUSAN BERBASIS ANDROID UNTUK MENENTUKAN KELAYAKAN SISWA PENERIMA REWARD MENGGUNAKAN METODE WEIGHTED PRODUCT', 'SISTEM PENDUKUNG KEPUTUSAN BERBASIS ANDROID UNTUK MENENTUKAN KELAYAKAN SISWA PENERIMA REWARD MENGGUNAKAN METODE WEIGHTED PRODUCT Novanda Sandiantara 15030020 INTISARI Sekolah Menengah Kejuruan Bina Harapan Sleman memiliki dua jurusan yaitu Teknik Komputer dan Jaringan Serta Teknik Pemboran Minyak. Adanya peningkatan kualitas belajar mengajar baik secara akademik dan non akademik yang semakin maju di SMK Bina Harapan, akan menambah motivasi siswa untuk mendapat reward. Reward akan diberikan kepada siswa berdasarkan kriteria-kriteria yang sudah ditetapkan oleh guru-guru. Terdapat empat kriteria yang digunakan untuk menentukan reward yaitu nilai rapot, absen, extrakurikuler, dan sikap. Kriteria-kriteria tersebut kemudian diolah menggunakan aplikasi sistem pendukung keputusan berbasis Android. Aplikasi sistem pedukung keputusan digunakan untuk menentukan siswa layak mendapat reward yang diolah menggunakan metode Weighted Product. Kemudian data alternatif yang digunakan adalah siswa SMK Bina Harapan kelas 12 yang berjumlah 35 siswa. Hasil dari pengolahan sistem dan manual sudah sesuai dengan hasil perhitungan, vektor V tertinggi dimiliki oleh Veni Nur Aviani dengan nilai 0,03263 dan terendah dimiliki oleh Muhammad Alif Nur I dengan nilai 0,01901. Kata Kunci: Reward, Sistem Pendukung Keputusan, Weighted Product, Android.', '011611144', '010409041', '');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('1d997f29', 15030043, 'PEMANFAATAN LIBRARY PORTABLE DOCUMENT FORMAT JAVASCRIPT (PDF.js) UNTUK MENGAMANKAN E-BOOK PADA E-LIBRARY SEKOLAH TINGGI TEKNOLOGI ADISUTJIPTO', 'PEMANFAATAN LIBRARY PORTABLE DOCUMENT FORMAT JAVASCRIPT (PDF.js) UNTUK MENGAMANKAN E-BOOK PADA E-LIBRARY SEKOLAH TINGGI TEKNOLOGI ADISUTJIPTO Oleh Agung Nugraha 15030043 INTISARI Perpustakaan Sekolah Tinggi Teknologi Adisutjipto (STTA) menjadi bagian dan unit penting di STTA yang berdiri sejak tahun 2002. Fungsi perpustakaan STTA yaitu memberikan layanan pinjam dan pengembalian buku yang dilakukan oleh anggota perpustakaan dalam hal ini mahasiswa, dosen dan karyawan STTA. Proses peminjaman secara manual dengan buku yang berwujud secara fisik ini telah berlangsung hingga saat ini. Buku yang jumlahnya selalu bertambah setiap tahun sangat menyita ruang yang ada di perpustakaan, sehingga perlu dikaji agar bentuk buku ini tidak lagi berwujud fisik tetapi digital atau paperless sehingga dapat disimpan di komputer server. Bentuk perpustakaan seperti ini dikenal sebagai perpustakaan digital atau e-library. E-library merupakan perpustakaan modern sebagai tempat yang menyediakan sumber informasi pendidikan dengan memberikan kemudahan dan keamanan yang lebih. Alur yang ada pada aplikasi tidak jauh berbeda dengan alur yang ada pada perpustakaan manual. Keamanan menjadi bagian penting dari sebuah aplikasi, dengan melakukan pembatasan terhadap akses pada jaringan, akses dokumen pdf dan implementasi PDF Viewer menggunakan library PDF.js dengan melakukan render dokumen pdf ke dalam canvas mampu mengahalau pengunduhan secara ilegal. Berdasarkan dari hasil pengujian, aplikasi e-library dapat berjalan dengan baik. Pada kecepatan buka dokumen pdf dipengaruhi oleh kecepatan server, konten yang ada didalam pdf, dan ukuran file pdf. Kata Kunci : E-library, library PDF.js, PDF Viewer, Keamanan. UTILIZATION OF PORTABLE DOCUMENT FORMAT JAVASCRIPT (PDF.js) LIBRARY TO SECURE E-BOOK IN SEKOLAH TINGGI TEKNOLOGI ADISUTJIPTO E-LIBRARY by Agung Nugraha 15030043 ABSTRACT Established in 2002, Sekolah Tinggi Teknologi Adisutjipto (STTA) Library become an important part of STTA. The function of STTA’s Library it self is to provide books rental and return services, in this case the students, lecturers, and the employees. Process of borrowing manually with tangible books have been physically present today. Amount of the books which always increasing every year are very confiscated place in the library, so it should be suggested that the form but digital form or paperless, so it can be store on the computer server. These types of libraries known as digital libraries or e-library. The e-library is a modern library that provides educational resources with greater ease and security. Working systems in this application same with existsing manual libraries. Security also become an essential part of an application by restricting access to the network, access PDF documents and implementing PDF viewer using the PDF.js library by rendering the PDF document into the cavas is able to minimize illegal downloads. Based on testing result, the e-library application can run well. The speed to open PDF document is affected by server speed, the content in the PDF, and PDF file size. Keywords : E-library, PDF.js library, PDF Viewer, Security.', '010303032', '011409116', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('d3aa8410', 15030017, 'PEMILIHAN LOKASI OUTBOUND DI GUNUNGKIDUL MENGGUNAKAN METODE MULTI OBJECT OPTIMIZATION ON THE BASE OF RATIO ANALYSIS (MOORA)', 'PEMILIHAN LOKASI OUTBOUND DI GUNUNGKIDUL MENGGUNAKAN METODE MULTI OBJECT OPTIMIZATION ON THE BASE OF RATIO ANALYSIS (MOORA) Oleh Istiqomah Nuraini 15030017 INTISARI Sistem pendukung keputusan adalah sebuah sistem terkomputeriasi yang dapat membantu pengguna dalam mengambil sebuah keputusan. Penerapan SPK ini salah satunya adalah untuk pemilihan lokasi outbound yang berada di Gunungkidul dengan menggunakan metode MOORA. Outbound merupakan metode belajar di alam terbuka yang dilakukan atas dasar pengalaman langsung yang disajikan dalam bentuk permainan, diskusi dan petualangan. Sehingga peserta akan mendapat umpan balik tentang dampak kegiatan yang dilakukan yang berguna untuk pengembangan diri kedepannya. Penerapan Metode MOORA merupakan metode yang dapat menentukan bobot pada setiap kriteria, kemudian dilanjutkan dengan proses perangkingan yang akan menyeleksi alternatif terbaik dari sejumlah alternatif yang ada. Personal Home Page (PHP) merupakan salah satu bahasa pemrograman yang didesain untuk pengembangan web. Dalam penelitian ini dibuatlah aplikasi pemilihan lokasi outbound yang berada di Gunungkidul menggunakan metode MOORA, aplikasi dirancang berbasis website, pengujian ini dilakukan menggunakan pengujian black box. Hasil dari penelitian ini menunujukkan bahwa lokasi terbaik berdasarkan bobot kriteria dan perangkingan dengan beberapa altenatif adalah lokasi Gunung Api Purba Nglanggeran dengan hasil nilai 0.1507, Air Terjun Sri Getuk dengan hasil 0.0909, Kampung Jelok dengan hasil 0.01497, Goa Pindul dengan hasil 0.00182, Pantai Sundak dengan hasil -0.07192, Wulenpari dengan hasil -0.08854, dan yang terakhir adalah pantai indrayanti dengan hasil -0.13179. Kata kunci : Sistem Pendukung Keputusan (SPK), Outbound, MOORA, PHP', '010209011', '0196305061990032001', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('96eaaf32', 15030038, 'PEMANFAATAN GOOGLE PLAY SERVICE UNTUK MENGUKUR KECEPATAN TERBANG DRONE BERBASIS CLIENT SERVER', 'PEMANFAATAN GOOGLE PLAY SERVICE UNTUK MENGUKUR KECEPATAN TERBANG DRONE BERBASIS CLIENT SERVER Daewu Gus Bintara Putra 15030038 INTISARI Drone sebagai peralatan terbang tanpa pilot telah mengalami perkembangan yang baik dikendalikan menggunakan remote control. Kecepatan drone yang belum dapat diakses pada remote kontrolnya dapat diketahui melalui aplikasi yang berbasis client-server. Aplikasi sisi client ada pada drone dan sisi server ada dibumi. Aplikasi My Drone (client) merupakan aplikasi yang dibawa terbang drone dan Admin Drone (server) merupakan aplikasi untuk memantau kecepatan menggunakan library Google Play Service, data yang didapat dikirim ke aplikasi Admin Drone (server) secara real-time dengan memanfaatkan Google firebase untuk pengiriman data. Dari pengujian yang dilakukan dapat diketahui kecepatan drone saat terbang horisontal, sedangkan saat terbang vertikal kecepatan tidak terdeteksi. Kapasitas baterai juga akan mengalami penurunan saat kecepatan drone 12.583 km/jam dari 60% menjadi 23% karena drone membutuhkan energi dari baterai untuk menggerakkan mesin drone mencapai kecepatan tersebut. Kata kunci : Drone, Google Play Service, Kecepatan Terbang.', '010303032', '011210095', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('1711fffa', 15030049, 'SISTEM PENDUKUNG KEPUTUSAN PENENTUAN GUEST STAR PADA E-MARKETPLACE BERBASIS WEB MENGGUNAKAN METODE WEIGHTED PRODUCT', 'SISTEM PENDUKUNG KEPUTUSAN PENENTUAN GUEST STAR PADA E-MARKETPLACE BERBASIS WEB MENGGUNAKAN METODE WEIGHTED PRODUCT Muhammad Ali Sofyan 15030049 INTISARI E-marketplace didefinisikan sebagai sebuah tempat jual beli barang dan jasa secara online yang dikelola oleh satu pihak yaitu developer, kemudian produk yang ada di dalamnya disediakan oleh pihak lain yaitu penjual. Dalam sebuah event biasanya ada bintang tamu (guest star) yang diminta penyelenggara acara untuk tampil sebagai pengisi acara disebuah event. Para penyelenggara event sering kali kesulitan dalam mencari guest star yang sesuai dengan kebutuhan untuk acaranya, di sisi lain para pengisi event seperti musisi, penari dan lain sebagainya juga kesulitan dalam mempromosikan jasanya. Metode weighted product dapat diterapkan untuk aplikasi sistem pendukung keputusan penentuan guest star pada e-marketplace berbasis web. Tujuan dari tugas akhir ini adalah untuk memberikan alternatif keputusan pemilihan guest star yang sesuai kriteria dengan menggunakan metode weighted product dan menciptakan sebuah pasar online untuk mendapatkan guest star yang sesuai dengan yang diharapkan. Terdapat tiga kriteria yang digunakan untuk menentukan guest star pada e-marketplace ini, yaitu jenis pertunjukan, harga dan lokasi. Sedangkan untuk alternatif yang diujikan sebanyak sembilan alternatif yang terdiri dari guest star yang ada di wilayah DIY. Hasil dari uji fungsionalitas berdasarkan pengujian black box menggunakan browser chrome, mozilla, opera dan Microsoft edge menyatakan bahwa semua fungsi validasi dan button yang ada pada e-marketplace dapat berjalan sesuai dengan fungsinya. Pengujian hasil implementasi sudah sesuai dengan perhitungan weighted product, yaitu guest star yang mempunyai hasil tertinggi dari keseluruhan adalah Frengki Sermadi dengan nilai 0,135234, sedangkan guest star yang mempunyai hasil terendah dari keseluruhan adalah Sanggar Titik Dua dengan nilai 0,083222. Kata Kunci: Sistem Pendukung Keputusan, Weighted Product, E-marketplace, Guest star, Website', '011210095', '011611144', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('986e9c75', 15030007, 'PENGGUNAAN LINEAR CONGRUENT METHOD PADA COMPUTER BASED TEST UNTUK SERTIFIKASI KARYAWAN PT. GMF AEROASIA TBK', 'Tes adalah sesuatu yang berfungsi untuk menguji kualitas sesuatu dari kecerdasan, kemampuan, hasil belajar. Salah satu hasil ujian dijadikan sebagai bukti sah yang bisa digunakan misalnya untuk naik pangkat atau lulus. Sistem ujian sertifikasi di PT GMF AeroAsia Tbk masih menggunakan kertas (Paper Based Test), penyelenggara ujian harus menyeleksi hasil ujian satu persatu dan peserta harus menuju ruang ujian pada waktu dan tempat yang ditentukan oleh ujian. penyelenggara. Sistem pemeriksaan ini dinilai tidak efektif. Untuk mengatasi hal tersebut maka perlu dibuat sistem ujian sertifikasi yang menggunakan komputer untuk menggantikan sistem ujian yang ada. Sistem ini dirancang sebagai tes berbasis komputer dengan menggunakan Metode Linear Congruent sebagai pengacak untuk menyusun soal guna menghemat waktu dan mengurangi pemakaian kertas, serta menjamin kualitas hasil ujian lebih akuntabel. Kata Kunci: Ujian, Tes Berbasis Komputer, Metode Kongruen Linier, Tes Berbasis Kertas.
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('f4b08e89', 15030066, 'ANALISIS PENGGABUNGAN KNOWLEDGE ACQUISITION PROSES HAARTRAINING UNTUK DETEKSI OBYEK PADA METODE VIOLA JONES', 'ANALISIS PENGGABUNGAN KNOWLEDGE ACQUISITION PROSES HAARTRAINING UNTUK DETEKSI OBYEK PADA METODE VIOLA JONES Oleh Nur Hanifah 15030066 INTISARI Proses Haartraining membutuhkan sumber daya komputer yang sangat tinggi dan waktu yang berbanding lurus dengan banyaknya data training. Jumlah data training menentukan akurasi pendeteksian obyek. Proses training yang lama diakibatkan karena komputer mempunyai spesifikasi yang rendah dan dengan pembagian file training akan mempercepat proses pembentukan file vector, meminimalisir kesalahan saat melakukan pemotongan fitur Haar pada obyek positif dan juga meminimalisir kesalahan yang terjadi saat melakukan proses training. Permasalahan yang muncul berikutnya bagaimana mengatasi hal tersebut sehingga di peroleh pengetahuan yang lebih baik. Penelitian ini memberikan usulan dan hasil analisis proses penggabungan knowledge acquisition serta pengaruhnya terhadap akurasi pendeteksian obyek menggunakan metode Viola-Jones dengan hasil akhir tingkat kesalahan yang terjadi sebesar 23.689% dan tingkat obyek terdeteksi sebesar 65.584%. Metode Viola Jones menggunakan file classifier yang diperoleh dari proses training. Kata Kunci : Knowledge Acquisition, Haartraining, Pendeteksian Obyek, Viola Jones', '010409041', '011210095', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('ab19a28c', 15030036, 'Pemanfaatan Firebase Pada Aplikasi Inventaris Guna Mendukung Usaha Mikro Kecil dan Menengah (UMKM) (Studi Kasus Kabupaten Gunung Kidul)', 'PEMANFAATAN FIREBASE PADA APLIKASI INVENTARIS GUNA MENDUKUNG USAHA MIKRO KECIL DAN MENENGAH (UMKM) (STUDI KASUS KABUPATEN GUNUNG KIDUL) Adetya Dyas Saputra 15030036 INTISARI UMKM adalah salah satu ujung perekonomian yang berdiri sendiri dan memiliki potensi perkembangan yang besar, salah satunya di Gunungkidul, Yogyakarta. Beberapa kendala pada bisnis UMKM ini salah satunya yaitu pada pemasaran dan manajemen produk, dimana para pelaku UMKM hanya dikenal di daerahnya saja dan kesulitan dalam memanajemen produknya. Dukungan dari sisi teknologi sangat diperlukan untuk meningkatkan laju perekonomian UMKM demi mengatasi masalah tersebut, dengan biaya yang minim serta mampu bekerja dengan baik di Kabupaten Gunungkidul dimana masih banyak daerah yang sulit mendapatkan sinyal untuk melakukan pemasaran dengan menggunakan smartphone. Firebase adalah platform buatan Google yang memiliki fitur unggulan realtime database yang sangat cocok untuk menanggulangi masalah tersebut karna kemampuannya yaitu offline-capability. Ada 2 aplikasi yang dibuat, untuk pelaku bisnis UMKM yang disebut Venstta Mitra dan untuk konsumen yang disebut Venstta. Venstta Mitra berfungsi untuk memasarkan produk UMKM serta melakukan manajemen stok, sedangkan Venstta berfungsi sebagai katalog produk UMKM. Berdasarkan pengujian yang diperoleh menggunakan skala Likert, Venstta Mitra memiliki skor pengujian fungsi fitur utama sebesar 78,8% dan uji UI/UX sebesar 69,6% sedangkan Venstta memiliki skor pengujian fungsi fitur utama sebesar 85,3% dan Uji UI/UX sebesar 70,2%, sehingga kedua aplikasi tersebut berjalan dan dapat diterapkan oleh kedua belah pihak. Kata kunci : Gunungkidul, Inventaris, UMKM, Firebase, Android', '011611144', '011611143', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('e3b2f669', 15030019, 'KONVERTER KALIMAT AKTIF MENJADI KALIMAT PASIF PADA BAHASA INGGRIS MEMANFAATKAN GOOGLE SPEECH API', 'KONVERTER KALIMAT AKTIF MENJADI KALIMAT PASIF PADA BAHASA INGGRIS MEMANFAATKAN GOOGLE SPEECH API Oleh Muhammad Zaenudin Sani 15030019 INTISARI Konverter kalimat aktif menjadi kalimat pasif memanfaatkan google speech Api merupakan aplikasi berbasis Android yang bertujuan untuk mengubah kalimat aktif menjadi kalimat pasif menggunakan input audio dengan pronunciation yang tepat. Aplikasi ini dapat membantu pelajar dalam mengubah kalimat bahasa Inggris aktif menjadi kalimat pasif. Sistem pada aplikasi ini tidak akan berjalan dengan baik jika kalimat yang dimasukkan tidak tepat, karena aplikasi ini menggunakan kalimat yang terbatas. Jika pengguna sudah memasukkan kalimat audio dengan pengucapan yang tepat, maka sistem akan mengonversikan audio kalimat aktif tersebut menjadi teks. Kemudian sistem akan mengubah teks kalimat aktif menjadi kalimat pasif berdasarkan tenses (simple present tense, simple past tense, present perfect tense, simple future tense). Aplikasi ini hanya dapat dioperasikan pada Android dengan minimal versi 4.0 IceCreamSandwich. Pengujian Aplikasi melibatkan 30 responden yaitu mahasiswa Sekolah Tinggi Teknologi Adisutjipto, yang mengambil mata kuliah bahasa Inggris. Hasil pengujian diperoleh nilai presentase 90.6% dengan predikat “sangat baik”. Kata kunci: kalimat aktif-pasif, bahasa Inggris, konverter, Android.', '010209011', '011410126', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('11685ef8', 15030061, 'FLIGHT SIMULATOR UNTUK TAKE OFF PESAWAT BOEING 737-300 SERIES BERBASIS 3 DIMENSI', 'FLIGHT SIMULATOR UNTUK TAKE OFF PESAWAT BOEING 737-300 SERIES BERBASIS 3 DIMENSI Oleh Muhammad Irfan 15030061 INTISARI Simulator merupakan bentuk peniruan kondisi yang menggambarkan perilaku sesuai dengan kenyataan dimana terdapat interaksi antara pengguna dengan simulasi. Simulator sangat berguna dalam mensimulasikan kejadian-kejadian yang dapat membatu dalam system belajar-mengajar. Hasil dari tugas akhir ini berupa simulator 3D Take-Off pada pesawat Boeing 737-300 berbasis desktop yang bertujuan sebagai media pembelajaran yang berisikan penjelasan materi mengenai take-off dari pesawat Boeing 737-300. Simulator ini memberikan inputan dengan data ideal yang berupa data weight, kecepatan pesawat saat lepas landas, pengaturan flaps, dan jarak untuk memahami pesawat melakukan proses V1, VR, dan V2. Metode pengumpulan data pada pembuatan simulator berupa observasi, analisa kebutuhan sistem dan kepustakaan. Simulator dibangun menggunakan Unity 3D, pemodelan aset 3D menggunakan Blender, dan pemodelan asset 2D menggunakan Photoshop. Pengujian simulasi meliputi uji kelayakan oleh pakar, pengujian Black box dan White Box. Hasil dari pengujian pakar diperoleh dari pemberian kuisioner untuk pakar dan memberikan hasil aplikasi yang dibuat dapat terbantu sebagai media pembelajaran dalam mata kuliah dunia penerbangan, dalam menyampaikan materi take off pada pesawat terbang. Hasil pengujian black box menyatakan bahwa semua fungsi pada simulator berjalan sesuai fungsinya pada Sistem Operasi Windows 7, Windows 8, Windows 10 dengan system type 64-bit. Hasil dari pengujian white box menyatakan bahwa perancangan simulator sesuai dengan hasil eksekusi simulator. Kata Kunci: Simulator Pesawat Terbang, take-off, Boeing 737-300
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('7ba8010f', 15030052, 'PENENTUAN PRIORITAS PENGELUARAN KEBUTUHAN NON RUTIN MENGGUNAKAN METODE MULTI-ATTRIBUTIVE BORDER APPROXIMATION AREA COMPARISON (MABAC) DI MASJID AN-NUUR PANDEYAN', 'PENENTUAN PRIORITAS PENGELUARAN KEBUTUHAN NON RUTIN MENGGUNAKAN METODE MULTI-ATTRIBUTIVE BORDER APPROXIMATION AREA COMPARISON (MABAC) DI MASJID AN-NUUR PANDEYAN', '010209011', '010301028', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('284eac43', 15030028, 'SISTEM IDENTIFIKASI KERUSAKAN MESIN PADA PESAWAT BRAVO AS202 MENGGUNAKAN BACKWARD CHAINING BERBASIS WEBSITE', 'SISTEM IDENTIFIKASI KERUSAKAN MESIN PADA PESAWAT BRAVO AS202 MENGGUNAKAN BACKWARD CHAINING BERBASIS WEBSITE Oleh Erni Jumiyanti 15030028 INTISARI Pada penelitian ini membahas tentang perancangan dan penerapan perangkat lunak berbasis website pada sebuah mesin pesawat militer latih yaitu Pesawat Bravo dengan seri AS202. Dengan adanya perangkat lunak ini mampu digunakan untuk mengetahui gejala kerusakan dalam mesin pesawat di luar perawatan (Inspection) menggunakan pendekatan Backward Chaining, untuk menentukan sebuah fakta yang mendukung hipotesa-hipotesa tersebut, dengan pendekatan yang ada diharapkan mampu untuk mengidentifikasi adanya kerusakan pada mesin Pesawat Bravo AS202. Kecelakaan pesawat komersil ataupun militer banyak mengakibatkan banyak korban, selain itu memberikan banyak kerugian bagi semua pihak. Kecelakaan pesawat militer yang telah terjadi selama ini selalu dikaitkan dengan banyak faktor seperti: human error, climate, maupun kerusakan engine. Dalam mengurangi resiko kerusakan pesawat militer maka dibutuhkan perawatan pada pesawat. Dalam penelitian ini menghasilkan sebuah aplikasi berbasis website yang berfungsi sebagai sistem identifikasi kerusakan mesin dengan menggunakan Backward Chaining yang mempermudah teknisi dalam mencari informasi kerusakan pada mesin Pesawat Bravo AS202. Kata Kunci : Bravo AS202, Backward Chaining, Website', '011611143', '010901061', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('f7a12d66', 15030016, 'MONITORING INTERFACES ETHERNET PADA CISCO CATALYST 3750 UNTUK MENJAMIN KEAMANAN PENGGUNAAN JARINGAN KOMPUTER', 'MONITORING INTERFACES ETHERNET PADA CISCO CATALYST 3750 UNTUK MENJAMIN KEAMANAN PENGGUNAAN JARINGAN KOMPUTER Oleh Dwi Nurhayati 15030016 INTISARI Di laboratorium komputer suatu instansi terdapat banyak perangkat komputer yang terhubung dengan jaringan, hal tersebut berdampak pada peningkatan kebutuhan jaringan dalam hal ini penggunaan bandwidth. Sehingga administrator membutuhkan banyak waktu untuk mengelola jaringan seperti monitoring dan management, contohnya pada perangkat Cisco Catalyst 3750. Hal ini menuntut administrator harus berada di tempat yang sama dengan perangkat jaringan yang sedang dikelola. Oleh karena itu, diperlukan sistem yang dapat memonitoring jaringan dari jarak jauh. Dimana sistem monitoring interfaces ethernet bekerja secara real time dan mampu mengatasi penggunaan jaringan komputer yang terus mengalami peningkatan. Sistem monitoring interfaces ethernet menerapkan port security pada sistem jaringan komputer yang berfungsi sebagai sistem keamanan jaringan komputer agar dapat mengurangi penggunaan jaringan di luar perangkat komputer yang telah didaftarkan atau diijinkan. Sistem monitoring interfaces ethernet yang berbasis Web ini nantinya akan digunakan untuk monitoring dan management perangkat Cisco Catalyst 3750 dengan memanfaatkan API. Hasil dari pengujian menunjukkan bahwa aplikasi dapat memudahkan administrator dalam mengelola jaringan, karena semua fungsi atau perintah yang ada di sistem monitoring interfaces ethernet sama dengan perintah yang ada di-command line. Selain itu, aplikasi monitoring interfaces ethernet dapat berjalan di Browser pada perangkat personal komputer dan smartphone secara responsive. Kata kunci : Port security, monitoring, interfaces ethernet, Cisco Catalyst, API.', '011611143', '010904068', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('13dabda5', 15030006, 'VIRTUAL LOCAL AREA NETWORK (VLAN) BERBASIS WEB PADA CISCO CATALYST 3750 MEMANFAATKAN APPLICATION PROGRAMMING INTERFACE (API) DARI CISCO', 'VIRTUAL LOCAL AREA NETWORK (VLAN) BERBASIS WEB PADA CISCO CATALYST 3750 MEMANFAATKAN APPLICATION PROGRAMMING INTERFACE (API) DARI CISCO Oleh Deno Daseftra Cessara 15030006 INTISARI VLAN merupakan salah satu teknologi komputer yang saat ini sangat dibutuhkan. Hal ini dikarenakan VLAN dapat membagi satu jaringan pada perangkat switch menjadi bagian-bagian kecil jaringan lain. Cisco Catalyst 3750 merupakan perangkat switch yang sudah menyediakan teknologi VLAN. Permasalahan yang ditemukan pada Cisco Catalyst 3750 adalah sistem manajemen VLAN yang masih berbasis command line dan tidak dapat diakses dari jarak jauh. Untuk itu dibuat VLAN berbasis GUI dan dapat diakses dari jarak jauh. VLAN yang dibuat berbasis Web dengan tujuan untuk memberikan kebebasan pemakaian device dan tidak harus terfokus pada satu jenis device saja. VLAN berbasis Web ini dibuat dengan memanfaatkan API Cisco sebagai penghubung antara bahasa pemrograman pada VLAN berbasis Web dengan bahasa pada perangkat lunak Cisco Catalyst 3750. Pemanfaatan Telnet berperan penting dalam pembuatan VLAN berbasis Web ini, dimana Telnet memberikan akses lebih luas pada Cisco Catalyst 3750 untuk diakses di luar aplikasi terminal emulator. Dengan pemanfaatan Telnet administrator cukup mengujungi IP yang telah dibuat untuk mengakses Cisco Catalyst 3750. Akses jarak jauh pada VLAN berbasis Web ini menggunakan port fowarding. Serveo.net adalah salah satu penyedia layanan port fowarding. Dengan memanfaatkan Serveo.net, VLAN berbasis Web yang masih dalam server local dapat diakses dari jarak jauh meski tanpa IP publik. Hasil pengujian pada penelitian ini menunjukkan bahwa VLAN berbasis Web terbukti dapat melakukan konfigurasi VLAN sehingga dapat digunakan untuk mengatur hubungan antar komputer sesuai dengan kebutuhan pada jaringan yang digunakan. Kata kunci : VLAN , API Cisco, Telnet, port fowarding, Cisco Catalyst 3750.', '011611143', '010904068', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('02a235dd', 15030027, 'KRIPTOGRAFI DENGAN METODE BAHASA JAWA WALIKAN YOGYAKARTA BERBASIS WEB', 'KRIPTOGRAFI DENGAN METODE BAHASA JAWA WALIKAN YOGYAKARTA BERBASIS WEB Oleh Ellyana Mega Dewantri Astuti 15030027 INTISARI Kriptografi merupakan suatu ilmu yang yang mempelajari tentang pengamanan sebuah pesan. Cara pengamanan pesan dilakukan dengan mengacak pesan (enkripsi) dan dikembalikan lagi kebentuk aslinya (deskripsi). Metode yang digunakan dalam kriptografi yaitu Bahasa Walikan Yogyakarta di mana metode pembentukannya menggunakan pergeseran letak huruf Aksara Jawa. Bahasa Walikan Yogyakarta menggunakan pergeseran sepuluh huruf Aksara Jawa atau dengan aturan baris pertama Aksara Jawa digeser baris ke tiga, baris ke dua aksara jawa digeser menjadi baris ke empat. Berdasarkan pengujian aplikasi ini dapat berjalan dengan lancar diberbagai jenis perangkat dengan syarat memiliki web browser dan koneksi internet. Namun dalam proses enkripsi dan proses deskripsi pada aplikasi ini terdapat kendala jika sebuah kata yang dienkripsi terdapat huruf m dan p berurutan maka dalam pengembalian kata tidak dapat dilakukan dengan benar. Kata Kunci : Kriptografi, Bahasa Walikan, Berbasis Web
