INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('2f491c78', 15030056, 'SIMULATOR MODUL PEMBELAJARAN MAINTENANCE KOMPONEN AVIONICS PADA SSCVR PN. 980-6022-001 DAN AIRCRAFT BATTERY PN. 405CH (Studi Kasus : Avionics Shop PT GMF AeroAsia Tbk)', 'SIMULATOR MODUL PEMBELAJARAN MAINTENANCE KOMPONEN AVIONICS PADA SSCVR PN. 980-6022-001 DAN AIRCRAFT BATTERY PN. 405CH (Studi Kasus : Avionics Shop PT GMF AeroAsia Tbk) Dwinny Puspa Dinar Saputri 15030056 INTISARI Perkembangan teknologi dapat dimanfaatkan sebagai penunjang dalam mengembangkan pembelajaran inovatif salah satunya menggunakan simulasi sebagai media pembelajaran interaktif. Hasil dari tugas akhir ini berupa simulator modul pembelajaran maintenance komponen avionics berbasis Android dan Desktop yang berisi materi pengenalan, pembongkaran, dan perakitan komponen avionics pada SSCVR PN. 980-6022-001 dan Aircraft Battery PN. 405CH yang bertujuan membantu proses pembelajaran di Avionics Shop PT GMF AeroAsia Tbk. Simulator dibangun menggunakan unity 3D dan pemodelan aset menggunakan blender. Pengujian simulator meliputi uji fungsionalitas dan uji kelayakan oleh pakar sebagai proses validasi dan verifikasi mengenai kriteria penilaian. Hasil dari uji fungsionalitas menyatakan bahwa semua fungsi dan button yang ada pada simulator dapat berjalan dengan baik sesuai dengan fungsinya. Hasil dari uji kelayakan diperoleh nilai rata-rata 90,4 dimana termasuk dalam kategori “Sangat Bagus” dan dinyatakan bahwa simulator telah memenuhi kebutuhan yang mendasari perancangan simulator, memenuhi kebutuhan semua pihak yang berkepentingan, dan dapat dijalankan dengan baik pada beberapa platform yang berbeda. Kata Kunci: Simulator pembelajaran maintenance komponen avionics, assemble-disassemble part component, Avionics, SSCVR, Aircraft Battery', '010409041', '010301030', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('17344de0', 14030045, 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN BROKER FOREX DENGAN METODE SIMPLE ADDITIVE WEIGHTING (SAW)', 'Forex trading is a foreign currency trading that utilizes the comparison of a country’s currency with another country. One who plays a role in this business is broker forex, forex brokers are professional companies that can also be in the form of agents, institutions or individuals that function to bring together the seller and the buyer in buying and selling foreign currency transactions. The number of companies Forex brokers that provide trading applications both on a website and mobile basis, make ordinary traders whose knowledge is still lacking in forex broker, it is difficult to make choices when choosing the ideal forex broker. The research carried out was to design and build a Decision Support System (SPK) application with the method of Simple Additive Weighting (SAW) with five predetermined criteria namely corporate identity, regulation, deposit withdrawal, responsive customer service (CS), and leverege. The SPK application made is tested with manual calculations. Based on the data tested 32 forex broker companies from the research got the best value of 0.45.', '010209011', '010301028', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('d08415e2', 14030050, 'PERANCANGAN APLIKASI FLIGHT INFORMATION DISPLAY SYSTEM (FIDS) GUNA MENINGKATKAN KUALITAS PELAYANAN JASA INFORMASI (Studi Kasus : Bandar Udara Domine Eduard Osok Sorong)', 'PERANCANGAN APLIKASI FLIGHT INFORMATION DISPLAY SYSTEM (FIDS) GUNA MENINGKATKAN KUALITAS PELAYANAN JASA INFORMASI (Studi Kasus : Bandar Udara Domine Eduard Osok Sorong) Oleh Paskalina Carolina Sraun 14030050 INTISARI Dunia penerbangan tidak hanya bertumpu untuk melayani para penumpang pesawat agar dapat tiba ditempat tujuan dengan cepat efisien dan dengan harga yang terjangkau. Hal yang terpenting adalah keselamatan, keamanan dan kenyamanan penerbangan itu sendiri dan bagaimana memberikan pelayanan (service) bagi para pengguna jasa secara maksimal dan memuaskan. Tampilan jadwal penerbangan dalam dunia penerbangan disebut Flight Information Display System (FIDS) di Bandara merupakan perangkat yang terdiri dari beberapa personal computer (PC) yang mengolah rutin jadwal penerbangan. Perancangan aplikasi FIDS yang akan dibuat adalah memasukan data info penerbangan yang sudah terjadwal di bandar udara Domine Eduard Osok. Aplikasi FIDS ini membantu dalam memanajem penumpang non penumpang baik keberangkatan (Depature), transit, atau kedatangan (Arrival) domistik maupun internasional sistem ini bekerja dengan memanfaatkan fasislitas jaringan Komputer/network. Selain untuk memanajemen penumpang system ini juga berguna untuk menginformasikan kepada pengunjung bandara non-penumpang tentang Schedule penerbangan. FIDS ini dibuat berbasiskan Web, sehingga aksesnya dilakukan melalui jaringan komputer Local Area Network (LAN). Pengaturan jadwal penerbangan di suatu bandar udara memerlukan suatu aplikasi yang berguna untuk menambah/menghapus jadwal dari suatu penerbangan. Kata kunci: Flight Information Display System (FIDS), Display Minimum System (DMS) Bandar Udara Domine Eduard Osok Sorong
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('ccdbdb7e', 14030074, 'VISUALISASI 3D PENGENALAN PESAWAT TERBANG KOMERSIAL BERBASIS TEKNOLOGI AUGMENTED REALITY DI ANDROID', 'VISUALISASI 3D PENGENALAN PESAWAT TERBANG KOMERSIAL BERBASIS TEKNOLOGI AUGMENTED REALITY DI ANDROID Oleh Calvin Emilianus Sirimase 14030074 INTISARI Penerbangan Komersial dalam mengenalkan informasi Pesawat yang digunakan untuk tujuan komersial yaitu masih menggunakan media cetak dan internet oleh karena itu, diperlukan sebuah aplikasi yang bisa mengenalkan dan memberikan informasi pesawat pada sebuah maskapai dengan memanfaatkan teknologi Augmented Reality. Dengan adanya teknologi Augmented Reality mampu memberikan informasi secara nyata dan bisa berinteraksi langsung dengan pesawat pada sebuah maskapai. Aplikasi ini dibuat dengan menggunakan aplikasi Unity dan Vuforia. Pembuatan model 3D menggunakan aplikasi Google SketchUp yang kemudian di-export ke aplikasi Unity. Pengujian dilakukan pendeteksian marker terhadap intensitas cahaya, jarak, ukuran marker, dan warna. Dari hasil pengujian marker untuk intensitas cahaya minimal 4 lx dan jarak efektif pendeteksian antara 20 cm sampai 40 cm dan ukuran marker minimal 350 x 350 Pixel. Pendeteksian marker pada kemiringan 30 derajat, 60 derajat dan 90 derajat memberi hasil dimana kamera smartphone hanya dapat mendeteksi marker pada kemiringan 60 sampai 90 derajat, sedangkan pada warna tidak berpengaruh dikarenakan pendeteksian tepi yang menjadi teknik dasar pembacaan marker oleh Vuforia. Aplikasi ini telah berhasil dibuat secara Augmented Reality dalam bentuk visualisasi 3D Pesawat Komersial sebagai media pendukung pengenalan pesawat terbang komersial. Aplikasi ini hanya dapat dijalankan pada smartphone berbasis Android dengan versi minimum 5.0. Kata kunci: Augmented Reality, marker, 3D, visualisasi, AR, android, Pesawat terbang, Penerbangan Komersial', '011210095', '010409041', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('96d9c430', 14030080, 'ANALISIS KUALITAS WEBSITE SEKOLAH TINGGI TEKNOLOGI ADISUTJIPTO BERBASIS WEBQUAL 4.0', 'ANALISIS KUALITAS WEBSITE SEKOLAH TINGGI TEKNOLOGI ADISUTJIPTO BERBASIS WEBQUAL 4.0 Aldio Bima Saifullah 14030080 Intisari Penelitian ini bertujuan mengidentifikasi Kualitas Website Sekolah Tinggi Teknologi Adisutjipto Berbasis Webqual 4.0 dari sudut pandang pengguna yaitu mahasiswa. Penelitian ini merupakan penelitian deskriptif dengan metode survei. Instrumen penelitian menggunakan angket. Subjek penelitian adalah mahasiswa STTA berjumlah 45 mahasiswa. Teknik analisis data menggunakan analisis deskriptif presentase. Hasil penelitian menunjukan bahwa Kualitas Website Sekolah Tinggi Teknologi Adisutjipto (STTA) Berbasis Webqual 4.0, dalam kategori “sangat baik” sebanyak 4 responden atau sebesar 8,89%, kategori “baik” sebanyak 8 responden atau sebesar 17,78%, kategori “cukup baik” sebanyak 22 responden atau sebesar 48,89%, kategori “kurang baik” sebanyak 8 responden atau sebesar 17,78% dan kategori “sangat kurang baik” sebanyak 3 responden atau sebesar 6,66%. Berdasarkan nilai rata-rata sebesar 80,64 bahwa Kualitas Website Sekolah Tinggi Teknologi Adisutjipto (STTA) Berbasis Webqual 4.0 masuk dalam kategori “Cukup Baik”. Hasil ini dipengaruhi oleh tiga dimensi faktor kualitas penggunaan, kualitas interaksi pelayanan dan kualitas informasi yang berada pada kategori Cukup Baik.', '010301030', '010301028', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('5a0e7beb', 14030019, 'MEDIA PEMBELAJARAN MENGHITUNG KELILING BIDANG DATAR BERBASIS DESKTOP', 'MEDIA PEMBELAJARAN MENGHITUNG KELILING BIDANG DATAR BERBASIS DESKTOP Oleh Riski Mulia Prakasa 14030019 INTISARI Dalam proses pembelajaran terdapat proses komunikasi yang berlangsung dalam suatu sistem, dan di dalamnya terdapat media pembelajaran sebagai salah satu komponen sistem pembelajaran tersebut. Menggunakan media dalam proses pembelajaran harus didasarkan filosofi atau alasan teoritis yang benar. Media pembelajaran menghitung keliling bidang datar berbasis desktop di rancang sebagai media pembelajaran untuk siswa kelas empat sekolah dasar dalam menghitung sebuah keliling bidang datar dalam bentuk animasi yang berbasis desktop. Metode library research atau penelitian kepustakaan. Adapun sumber data yang digunakan adalah data-data primer dan sekunder dari buku Tematik tujuh dan beberapan jurnal mengenai teori perhitungan bidang datar. Hasil Pengujian aplikasi menggunakan kuesioner dengan koresponden 17 pengguna dengan tingkat keberhasilan menggunakan perhitungan skala likert dengan hasil nilai rata-rata adalah 2,8 yaitu nilai interval kriteria “baik” dengan mutu penilaian A. Dan pengujian kedua melalui palatform youtube telah ter-publish social media palatform youtube mendapatkan view 64, dan comment 16. Hasil telah tayang sebanyak 63 kali tayang dan mendapatkan 16 komentar. Rata-rata pengguna memberi komentar “Aplikasinya sangat bermanfaat”. Kata Kunci: Media Pembelajaran, Animasi 2D, Keliling Bidang Datar.', '010301030', '011210095', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('3e9ced2d', 14030040, 'VISUALISASI TAHAPAN PEMBANGUNAN RUMAH ADAT SUKU SASAK LOMBOK TENGAH BERBASIS ANIMASI 3 DIMENSI', 'VISUALISASI TAHAPAN PEMBANGUNAN RUMAH ADAT SUKU SASAK LOMBOK TENGAH BERBASIS ANIMASI 3 DIMENSI Haerul Anam 14030040 Intisari Rumah Adat Suku Sasak adalah simbol dari sebuah peradaban masyarakat terutama masyarakat yang berada di Lombok Tengah berfungsi sebagai tempat tinggal dan melakukan aktivitas seperti tidur, memasak, melahirkan dan menenun.. Pembuatan Rumah Adat Suku Sasak Lombok Tengah saat ini telah mengalami beberapa perubahan diantaranya perubahan bentuk ruang, bahan dan jenis yang terjadi karena perubahan zaman serta terkontaminasi pembangunan rumah modern di sekitar pemukiman Suku Sasak. Untuk mempertahankan nilai dan bentuk serta fungsi rumah adat, maka perlu adanya suatu media untuk membantu masyarakat dalam mempertahankan, mengetahui nilai-nilai, fungsi dan bentuk Rumah Adat Sasak Lombok Tengah seperti zaman dahulu. salah satu Media yang menarik yaitu bisa memberikan pengetahuan dan memberikan sesuatu yang baru dalam bentuk visualisasi animasi 3Dimensi. Dalam Penelitian tentang Rumah Adat Sasak Lombok Tengah ini menggunakan metode library research atau penelitian kepustakaan. Adapun sumber data yang digunakan adalah data-data primer dan sekunder dari masyarakat sekitar Dusun Sade, Desa Rembitan, Dinas Pariwisata Lombok Tengah dan Dinas Kepustakaan dan Kearsipan Lombok Tengah. Berdasarkan analisa data dan kuesioner yang dilakukan diperoleh hasil bahwa Rumah Adat Suku Sasak perlu pengembangan dalam bentuk media visual yang lebih menarik dan mampu menjadi daya tarik bagi masyarakat Lombok Tengah untuk mengetahui dan mempertahankan nilai-nilai peninggalan leluhur. Hasil Pengujian aplikasi menggunakan kuesioner dengan koresponden 30 masyarakat umum dengan tingkat keberhasilan menggunakan perhitungan skala Guttmann mendekati sesuai dengan presentase 90,6%. Kata Kunci: Suku Sasak, Rumah Adat, Media Visual', '010706059', '011611144', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('ca2c4e7f', 14030042, 'SISTEM REKOMENDASI TOPIK TUGAS AKHIR MENGGUNAKAN SIMPLE ADDITIVE WEIGHTING DAN WEIGHTED PRODUCT (STUDI KASUS: PROGRAM STUDI TEKNIK INFORMATIKA STTA YOGYAKARTA)', 'Sistem Rekomendasi Topik Tugas Akhir Menggunakan Simple Additive Weighting dan Weighted Product (Studi Kasus: Program Studi Teknik Informatika STTA Yogyakarta) Oleh: Opsidion Tegar Pratama 14030042 INTISARI Mahasiswa dalam melaksanakan studi di perguruan tinggi dituntut untuk menjalankan prasyarat mencapai derajat sarjana strata 1 (S1) dengan cara melakukan riset dan menyusun sebuah laporan tugas akhir.Sehubungan dengan prasyarat tersebut maka dibuatlah sebuah sistem perekomendasian untuk membantu pemilihan topik tugas akhir yang sesuai dengan nilai yang telah mahasiswa tersebut dapatkan pada saat melaksanakan kuliah strata 1 (S1), yang tentunya berdasarkan kriteria yang telah di tentukan.Semua itu disusun menggunakan dua buah metode penyaringan Simple Additive Weighting dan Weighted Product, dimana dari hasil kedua metode tersebut akan dibandingkan metode mana yang lebih cocok digunakan untuk rekomendasi tersebut. Hasil hitung menggunakan metode WP jika dirata-rata menghasilkan nilai 0.2154 dimana masih jauh dengan maksimal nilainya yaitu 1, sedangkan jika metode SAW dirata-rata menghasilkan nilai 95.5236 dimana hasil tersebut mendekati nilai maksimalnya yaitu 100. Berdasar pada hasil pengujian sistem didapatkan kesimpulan bahwa sistem yang dibangun lebih cocok menggunakan metode SAW untuk mendapatkan rekomendasi yang akurat. Kata Kunci: Weighted Product, Simple Additive Weighting, Sistem Rekomendasi, Topik TA', '011611143', '010706059', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('bd21db30', 14030023, 'GAME 3D PERGERAKAN HOVERING PADA HELIKOPTER', 'Game berdasarkan visualnya dapat dibagi menjadi 2 yaitu game 3 Dimensi (3D) dan game 2 Dimensi (2D). Game dapat menjadi media pembelajaran yang interaktif bagi pengguna. Salah satu jenis pesawat terbang adalah Helikopter. Helikopter memiliki gerakan dasar (basic manuevers) salah satunya adalah gerakan melayang (hovering). Pembuatan Game 3D pergerakan Hovering pada helikopter dapat menjadi media pembelajaran yang interaktif tentang pergerakan hovering. Hasil dari Game 3D pergerakan Hovering yang telah ter-publish pada situs itch.io mendapatkan view 104, download 40, ratings 2, collections 3, comments 3, impressions 500, click to ratio (ctr) 1%. Hasil Pengujian aplikasi menggunakan kuesioner dengan responden 30 mahasiswa dengan tingkat keberhasilan menggunakan perhitungan skala Guttman mendekati sesuai dengan presentase 92,6%. Kata Kunci : Game 3D, Hovering, Helikopter.', '010301030', '01181187', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('e1e2de5a', 14030076, 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN WEB HOSTING DI SEKOLAH TINGGI TEKNOLOGI ADISUTJIPTO MENGGUNAKAN METODE SIMPLE MULTI ATTRIBUTE RATING TECHNIQUE (SMART)', 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN WEB HOSTING DI SEKOLAH TINGGI TEKNOLOGI ADISUTJIPTO MENGGUNAKAN METODE SIMPLE MULTI ATTRIBUTE RATING TECHNIQUE (SMART) Oleh Rosmina Kaledupa 14030076 INTISARI Web hosting merupakan layanan hosting yang menyediakan suatu server tempat penyimpanan (Storage) data untuk menempatkan situs Web dimana dapat diakses umum yang terkoneksi ke jaringan internet dari Personal Computer (PC) di seluruh penjuru dunia sehingga memungkinkan pengguna lain untuk mengakses data tersebut dimanapun secara bersamaan, jasa web hosting menyediakan paket-paket web hosting dengan berbagai aplikasinya, seperti server Hypertext Trasnfer Protocol (HTTP) untuk layanan situs web, server File Transfer Protocol (FTP) untuk transmisi file (upload dan download), server email untuk dapat melakukan suatu fungsi penerimaan email, domain name server (DNS), suatu database server. Hosting juga dibedakan menjadi dua yaitu Paid Hosting dimana pelanggan hosting dikenakan biaya atas paket serta fasilitas yang diberikan sesuai dengan pilihannya, sedangkan Free Hosting dimana pelanggan Hosting tidak dikenakan biaya sama sekali atas paket dan fasilitas yang digunakan. Sistem Pendukung Keputusan (SPK) menggunakan metode Simple Multi Attribute Rating Technique (SMART) dengan lima kriteria yang sudah ditentukan yaitu harga, performa, review tambahan, dukungan teknis, dan fitur tambahan. Aplikasi SPK yang dibuat diuji coba dengan membandingkan perhitungan manualnya. Berdasarkan data yang diuji sebanyak 32 Web Hosting didapatkan hasil nilai lebih dari 70, dengan kata lain 32 Web Hosting tersebut masuk ke dalam rekomendasi layak. Kata kunci : Sistem Pendukung Keputusan, Web Hosting, Simple Multi Attribute Rating Technique
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('811cd8de', 14030069, 'DUKUNGAN TEKNOLOGI INFORMASI UNTUK ANTRIAN RAWAT JALAN PADA KLINIK PRATAMA BERBASIS MOBILE DENGAN METODE PRIORITY SCHEDULING DAN FIRST COME FIRST SERVED SCHEDULING (FCFS)', 'DUKUNGAN TEKNOLOGI INFORMASI UNTUK ANTRIAN RAWAT JALAN PADA KLINIK PRATAMA BERBASIS MOBILE DENGAN METODE PRIORITY SCHEDULING DAN FIRST COME FIRST SERVED SCHEDULING (FCFS) Saprudin 14030069 Intisari Sistem antrian rawat jalan di Klinik Pratama masih menggunakan manual sehingga dapat menerapkan teknologi terkomputerisasi (mobile) untuk meningkatkan pelayanan kesehatan pada pasien. Dalam pembuatan aplikasi sistem antrian rawat jalan ini menggunakan metode Priority Scheduling yang merupakan suatu algoritma penjadwalan prioritas. Setiap proses dilengkapi dengan nomor prioritas (nilai integer terkecil biasanya merupakan prioritas terbesar). Aplikasi sistem antrian rawat jalan ini berbasis mobile dengan tujuan agar pasien dapat mendaftar secara online. Hasil pengujian menggunakan perbandingan smartphone dari versi Android 4.1 Jelly Bean sampai versi Android 7.0 Nougat bisa berjalan. Perbandingan jarak dalam aplikasi dengan google maps, mendapatkan hasil yang sama dan pengujian pengguna aplikasi menggunakan kuesioner yang dihitung dengan Skala Likert mendapatkan hasil 81,8% termasuk kategori "Sangat Baik". Kata Kunci: Ponsel, Priority Scheduling, First Come First Served Scheduling (FCFS), Sistem Antrian.', '010209011', '010301030', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('6dd7c867', 14030084, 'PEMANFAATAN GEOFENCE UNTUK PEMBERITAHUAN EVENT BERBASIS ANDROID (STUDI KASUS: DIY)', 'PEMANFAATAN GEOFENCE UNTUK PEMBERITAHUAN EVENT BERBASIS ANDROID (STUDI KASUS: DIY) Oleh NISYA AMELIA 14030084 INTISARI Pada era teknologi seperti sekarang sudah banyak orang memanfaatkan teknologi canggih seperti smartphone android. Smartphone memang bisa dijadikan untuk memenuhi akan beberapa informasi. Akan tetapi ada beberapa informasi yang sangat sulit ditemukan jika hanya mengandalkan smartphone. Salah satunya adalah informasi tentang event di DIY. Oleh karena itu peneliti berinisiatif untuk membangun sebuah aplikasi yang dapat menjadi media untuk menginformasikan waktu dan tempat event tersebut diadakan kepada masyarakat. Pembangunan aplikasi ini bertujuan untuk mempermudah admin memberikan notifikasi event kepada pengguna melalui aplikai android. Aplikasi ini dibuat menggunakan bahasa pemograman java dan database mysql. Selain itu terdapat juga pemanfaatan google maps android API untuk menampilkan map pada aplikasi android. Aplikasi ini dapat menampilkan list-list event yang akan berlangsung dimana di dalam list event sudah ada keterangan mengenai event seperti tanggal, jam dan tempat pelaksanaan event dan juga terdapat map lokasi dimana event tersebut akan berlangsung. Adanya aplikasi pemanfaatan geofence untuk pemberitahuan event berbasis android ini diharapkan dapat membantu masyarakat untuk mendapatkan informasi-informasi mengenai event-event yang akan diselenggarakan di DIY. Kata Kunci: Android, Geofence, Google, Event, API, Java, Database Mysql.', '011210095', '010301028', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('d141cf2c', 14030049, 'KEAMANAN LAYANAN PERTUKARAN DATA PADA APLIKASI SHORT MESSAGE SERVICE (SMS) MENGGUNAKAN ALGORITMA PHYTAGORAS BERBASIS ANDROID', 'KEAMANAN LAYANAN PERTUKARAN DATA PADA APLIKASI SHORT MESSAGE SERVICE (SMS) MENGGUNAKAN ALGORITMA PHYTAGORAS BERBASIS ANDROID Oleh Lilik Giri Rezando 14030049 INTISARI Pengiriman data dapat dilakukan dengan berbagai jenis layanan, salah satunya layanan Short Message Service (SMS). Pertukaran data melalui layanan SMS masih ditemukan celah kekurangannya yaitu pada keamanan dan dan kerahasiaan data. Penelitian ini memanfaatkan kriptografi dengan menggunakan algoritma phytagoras untuk mengamankan data pada layanan SMS. Penggunaan algoritma phytagoras ini berdasar dari rumus phytagoras yang ada dalam matematika. Berdasarkan hasil pengujian perbandingan perhitungan secara manual dan aplikasi didapatkan hasil yang sama antara enkripsi dan dekripsi, sedangkan untuk hasil pengujian kunci didapatkan hasil dekripsi yang mendekati dengan pesan sebelum di enkripsi hanya ada satu kunci yang mampu melakukan proses dekripsi dengan baik yaitu kunci yang menggunakan indeks 8. Kata Kunci: Kriptografi, Algoritma Phytagoras, Keamanan Data, SMS.', '011611143', '010904068', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('e2798338', 14030066, 'PERBANDINGAN METODE QUICK SORT DAN MERGE SORT UNTUK PENILAIAN USER INTERFACE DAN USER EXPERIENCE PADA WEBSITE SEKOLAH TINGGI TEKNOLOGI ADISUTJIPTO YOGYAKARTA', 'PERBANDINGAN METODE QUICK SORT DAN MERGE SORT UNTUK PENILAIAN USER INTERFACE DAN USER EXPERIENCE PADA WEBSITE SEKOLAH TINGGI TEKNOLOGI ADISUTJIPTO YOGYAKARTA Oleh Muhammad Zainal Abidin 14030066 INTISARI Sistem aplikasi website kuisioner untuk menilai user interface dan user experience pada website Sekolah Tinggi Teknologi Adisutjipto menggunakan metode merge sort yang nantinya akan dibandingkan dengan metode quick sort untuk mencari nilai tertinggi atau bagian mana yang dinilai bagus atau baik dari website Sekolah Tinggi Teknologi Adisutjipto dari beberapa unsur atau kategori yang sudah ditentukan. Kemudian dari hasil perbandingan dari kedua metode akan dibandingkan untuk mengetahui metode yang terbaik untuk proses pengurutan data atau sorting data, untuk perbandingannya akan dinilai dari segi kecepatan dan keakuratan data dalam proses mengurutkan data yang sudah terkumpul pada web kuisioner masing-masing. Setalah proses pengujian serta perbandingan maka ditemukan hasil dan kesimpulan dari kedua metode, dengan kecepatan rata-rata 0,576667 detik untuk metode merge sort dan 0,476667 detik untuk metode quick sort. Dan untuk keakuratan yang dihasilkan, metode merge sort lebih akurat dibanding metode quick sort dengan perbandingan data perhitungan manual menggunakan Microsoft excel. Kata Kunci: Kuisioner, Merge Sort, User Interface, User Experience, Quick Sort.', '010301030', '010301028', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('a8bd5382', 14030001, 'SIMULASI PERGERAKAN PESAWAT TERBANG PADA PESAWAT BOEING 737-400 DALAM BENTUK 3 DIMENSI', 'SIMULASI PERGERAKAN PESAWAT TERBANG PADA PESAWAT BOEING 737-400 DALAM BENTUK 3 DIMENSI Oleh Ridwan Subagyo 14030001 INTISARI Teknologi dimensi multimedia dapat digunakan dalam membuat pesawat terbang terbang pada pesawat boeing 737-400. Tujuan pembuatan simulasi tiga dimensi tersebut adalah untuk memudahkan dosen dalam menjelaskan tentang pergerakan pesawat terbang yang menggunakan teknik pemodelan poligon dengan perangkat lunak Blender dan Unity 3D, dengan cara memodeling objek 2D yang berupa badan,sayap,ekor dan lingkungan menggunakan blueprint dan melanjutkan menjadikan 3D setelah jadi di beri tektur dan warna perancangan simulasi meliputi konfigursi objek pesawat,lingkunga,kamera dan keyboard. hasi pengujian simulasi tiga dimensi pesawat boeing 737-400 ini, dapat digunakan oleh aplikasi simulasi dengan versi windows 7,8 dan 10. Aplikasi simulasi ini dapat berjalan dengan ram normal 2Gb dan prosesor 1.2Ghz dan memproses hasil kecepatan lepas landas dan berat pesawat. Kata kunci: Simulasi,Aminasi 3D, Polygonal modeling,Pergerakan Pesawat', '010706059', '011001072', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('e8ec518a', 14030020, 'PENGEMBANGAN SISTEM PENGOLAHAN SERTIFIKAT BERBASIS WEB DI SEKOLAH TINGGI TEKNOLOGI ADISUTJIPTO', 'PENGEMBANGAN SISTEM PENGOLAHAN SERTIFIKAT BERBASIS WEB DI SEKOLAH TINGGI TEKNOLOGI ADISUTJIPTO Moh. Erton Pati Gustian 14030020 Intisari Sertifikat adalah secarik surat sebagai tanda pengakuan bahwa seseorang menguasai kompetensi tertentu, telah mengikuti suatu event, atau tanda kepemilikan suatu barang. Sertifikat tidak semuanya berbentuk hard copy terkadang juga ada yang berbentuk soft copy atau juga bisa disebut dengan e-sertifikat. Tujuan dibuatnya system pengolahan sertifikat berbasis web di Sekolah Tinggi Teknologi Adisutjipto adalah untuk membantu dalam proses pembuatan sertifikat agar lebih mudah dan cepat, Pembuatan system pengolahan sertifikat menggunakan PHP dan database MySql, sertifikat berbentuk portable document format (PDF). Cara kerja dari system ini dimulai dari memasukkan data kemudian memproses data dan menampilkan output, dalam tahap pengujian system ini masih diimplementasikan pada localhost dan komputer sendiri, akan tetapi masih membutuhkan jaringan internet pada saat akan menampilkan output dan tahap drag and drop output. Pengujian aplikasi ini menggunakan aplikasi laragon sebagai server kemudian aplikasi DBeaver untuk membuka database dan browser untuk menjalankan system pengolahan sertifikat, hasil dari pengujian aplikasi ini ialah pada output sertifikat menampilkan semua data yang sudah di daftarkan mulai dari data pengesahan, data sertifikat dan data mahasiswa dan apabila tidak memasukkan salah satu data maka pada tampilan output akan terjadi error, kemudian tampilan output yang masih tidak terlalu rapi. Kata Kunci: Sertifikat, System, Database MySql, PDF, Laragon,Dbeaver, Localhost, Web, PHP, Internet, Drag and Drop.', '010409041', '011409116', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('9c4174c8', 14030062, 'PEMETAAN SUMBER AIR DILOKASI KEBAKARAN DI WILAYAH KOTAMADYA YOGYAKARTA BERBASIS ANDROID', 'PEMETAAN SUMBER AIR DILOKASI KEBAKARAN DI WILAYA KOTAMADIYA YOGYAKARTA BERBASIS ANDROID Bayu Sugara 14030062 INTISARI Sistem pemadam kebakaran dalam menempatkan tandon masih banyak petugas yang tidak tahu tempat lokasinya sehingga dapat menerapkan teknologi terkomputerisasi (mobile) agar dalam pekerjaanya petugas pemadam kebakaran dapat memaksimalkan teknologi informasi yang di buat oleh penulis dengan baik. Aplikasi sistem pemetaan tandon berbasis mobile dengan tujuan agar petugas dapat dengan mudah menemukan lokasi tandon yang terdekat dari lokasi kebakaran dan dimana petugas juga dapat mengetahui lokasi jarak tandon dari kebakaran. Hasil pengujian akurasi ketepatan dengan Geoogle maps dimana akurasi tersebut sangat tepat terhadap lokasi sumber air atau tandon . Pengujian menggunakan perbandingan smartphone dari versi Android 4.1 Jelly Bean sampai versi Android 7.0 Nougat bisa berjalan dengan hasil jarak dalam aplikasi menggunakan google maps, mendapatkan hasil yang sama dan dimana terdapat pengujian versi Android V4.4 kitkat yang tidak berhasil karena RAM tidak mendukung untuk aplikasi ini. Pengujian dalam bentuk motode black box dimana metode ini menguji setiap fungsi-fungsi yang terdapat diaplikasi dan pengujian tersebut berfungsi dan berjalan semesetinya yang dimana sistem berfungsi dengan baik. Kata Kunci: Ponsel, Pemetaan Sumber Air, Android,Pemadam Kebakaran', '010301028', '010409041', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('e9eb7e57', 14030006, 'VIRTUAL ASISTEN DENGAN MENGGUNAKAN METODE K-MEANS UNTUK CLUSTERING BUKU', 'Perpustakaan merupakan sumber belajar yang harus dimiliki oleh setiap sekolah atau perguruan perguruan tinggi. Karena mahasiswa dengan mudah mencari informasi atau ilmu pengetahuan melalui perpustakaan. Dengan adanya perkembangan teknologi membuat manusia berfikir untuk dapat bekerja lebih efektif dan efisien. Salah satunya yaitu membuat sistem konvensional menjadi sistem terkomputerisasi. Dengan memanfaatkan machine learning untuk virtual assistant pada website perpustakaan. Pada penelitian ini dikembangkan suatu sistem informasi berbasis web dengan memanfaatkan machine learning mnggunakan bahasa pemrograman PHP MySQL. Dengan sistem ini, diharapkan website mampu memberikan informasi koleksi terbaru yang sesuai dengan rekam jejak peminjaman koleksi. Dari hasil penelitian yang telah dilaksanakan penulis mengimplementasikan hasil penelitian ke dalam Virtual Asisten Dengan Menggunakan Metode K-Means Untuk Clustering Buku. Kata Kunci : Machine Learning, Perpustakaan, Virtual Asisten, Website
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('2654a452', 14030043, 'PENERAPAN MODIFIKASI ALGORITMA VIGENERE CIPHER MENGGUNAKAN METODE CATALAN NUMBER DAN DOUBLE COLUMNAR TRANSPOSITION PADA APLIKASI CHATTING BERBASIS ANDROID', 'PENERAPAN MODIFIKASI ALGORITMA VIGENERE CIPHER MENGGUNAKAN METODE CATALAN NUMBER DAN DOUBLE COLUMNAR TRANSPOSITION PADA APLIKASI CHATTING BERBASIS ANDROID', '010409041', '011409116', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('ede16a87', 14030015, 'KRIPTOGRAFI BORIZQY SECURE ENCRYPTION (BOSE) DENGAN MENGIMPLEMENTASIKAN ALGORITMA HUFFMAN PADA SISTEM KARTU KREDIT VIRTUAL (Studi Kasus: Fiko.in)', 'Kartu kredit virtual merupakan bentuk virtual dari kartu kredit sebagai media untuk bertransaksi online di dunia maya. Kartu kredit virtual mempunyai data yang sama seperti kartu kredit pada umumnya, yaitu data nomor kartu, tanggal kedaluwarsa, dan kode keamanan. Kartu kredit virtual dapat digunakan untuk bertransaksi orang lain hanya dengan mengetahui ketiga data tersebut. Dibuatlah kriptografi menggunakan algoritma Borizqy Secure Encryption (BOSE) yang mengimplementasikan algoritma Huffman untuk mengenkripsi data kartu kredit virtual menggunakan private-key yang hanya diketahui pihak pemilik kartu kredit virtual. Kriptografi ini memungkinkan data kartu kredit virtual disimpan dengan bentuk terenkripsi, kemudian pihak pemilik kartu kredit virtual membuka data yang telah terenkripsi menggunakan private-key yang terlah ditentukan sebelumnya ketika mengenkripsi data.', '010409041', '011611143', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('c4b6a2df', 14030051, 'PERBANDINGAN ReST DAN SOAP PADA TEKNOLOGI WEB SERVICE UNTUK LAYANAN DATA BERBASIS ANDROID', 'Web service pada umumnya digunakan untuk melakukan menyediakan layanan data antara platform yang berbeda seperti web dan aplikasi mobile. Web service yang ada dan berkembang saat ini adalah ReST API dan SOAP. Pada penelitian ini dilakukan perbandingan antara web service ReST API dan SOAP dalam menyediakan layanan data untuk aplikasi client berbasis Android. Pengujian pengambilan data dilakukan pada perangkat smartphone dengan spesifikasi yang berbeda. Data yang diujikan terbagi menjadi 2, yaitu data dengan format ukuran yang sama dan data dengan format ukuran yang berbeda. Pengujian terbagi menjadi 3 tahapan, yang pertama diuji dengan 10 data, ke dua 20 data, dan yang ke tiga 30 data, dengan cara melakukan load data dari masing-masing web service yang dibandingkan. Dari hasil pengujian tersebut diperoleh hasil bahwa pengujian dengan format ukuran data sama tidak membuat waktu sinkronisasi data juga sama. Dari hasil keseluruhan pengujian tersebut diperoleh hasil bahwa ReST API berjalan lebih cepat daripada SOAP. Dengan jumlah seluruh rata-rata waktu sinkronisasi data pada perangkat yang berbeda dengan format ukuran sama pada ReST API menghasilkan waktu 3.4 detik dan SOAP menghasilkan waktu 3.9 detik. Sedangkan sinkronisasi data pada perangkat yang berbeda dengan format ukuran berbeda pada ReST API memperoleh waktu 4.7 detik dan SOAP memperoleh waktu 5.3 detik. Teknologi web service ReST API dan teknologi web service SOAP dapat diimplementasikan di dalam aplikasi client Android dengan minimal versi Android Lollipop 5.0.1.', '011210095', '010409041', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('4517dacc', 14030027, 'PEMANFAATAN PARALLEL PROCESSING UNTUK SINKRONISASI DATA PADA DATABASE', 'PEMANFAATAN PARALLEL PROCESSING UNTUK SINKRONISASI DATA PADA DATABASE Muhammad Rifa’I Nur Syahfendi 14030027 Intisari Parallel Processing adalah proses yang menggunakan lebih dari satu processor untuk mengerjakan sebuah. Sinkronisasi data merupakan sebuah proses untuk menyamakan data dan waktu agar tidak terjadi perbedaan data, sinkronisasi data pada database dapat bertujuan untuk sistem keamanan database. Penggunaan parallel processing untuk sistem sinkronisasi data diharapkan dapat mempersingkat waktu proses sinkronisasi. Sistem ini berjalan pada sistem operasi Linux dan Windows berupa service yang tidak membebabi database server .Cara kerja sistem ini yaitu membandingkan antara database aplikasi dengan database server, jika ada perubahan data pada database aplikasi maka akan mengembalikan data kembali seperti semula. Pengujian ini dilakukan dengan menggunakan dua jaringan yang berbeda yaitu jaringan peer to peer dan LAN dengan perubahan data sebanyak 10 data, 20 data, 30 data, 100 data, 500 data, 1000 data, 1500 data, 1750 data, 2000 data dan 3000 data dengan jumlah data 65517 data. Diperoleh hasil waktu rata-rata sinkronisasi pada jaringan peer to peer 17.956 detik pada komputer 1 dan 20.365 detik pada komputer 2. Hasil waktu rata-rata sinkronisasi data pada jaringan LAN 14.224 detik pada komputer 1 dan 22.669 detik pada komputer 2. Faktor yang mempengaruhi perbedaan waktu ini adalah banyaknya data yang diuji, penggunaan perangkat komputer yang berbeda serta bandwidth yang disediakan provider. Kata Kunci: Parallel Processing, Sinkronisasi, Database Server, Pemanfaatan, Peer to Peer, LAN.', '010409041', '010301030', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('239849b5', 14030052, 'SISTEM INFORMASI DAN AGENDA KEGIATAN DESA BERBASIS TELEGRAM (Studi Kasus : Kelurahan Nomporejo)', 'SISTEM INFORMASI DAN AGENDA DESA BERBASIS TELEGRAM (STUDI KASUS : KELURAHAN NOMPOREJO) Oleh Panji Pamungkas 14030052 INTISARI Distribusi informasi menggunakan Telegram diperlukan dalam penyaluran data maupun infomasi, salah satunya pendistribusian informasi di Kelurahan Nomporejo. Di Kelurahan Nomporejo belum ada sistem informasi dari Kelurahan ke masyarakat secara elektronik, hal tersebut menyebabkan masyarakat kesulitan dalam mendapatkan informasi desa. Berdasarkan permasalahan tersebut dibuatlah Sistem Informasi dan Agenda Desa untuk menyebarkan informasi melalui media Telegram dan memudahkan masyarakat dalam mendapatkan informasi melalui media elektronik. Hasil dari pengujian menggunakan White Box dengan mengekseskusi semua looping pada path baris program terhadap 5 path selama 3 hari didapatkan tingkat keberhasilan sebesar 100%. Hasil dari pengujian dengan Skala Likert dengan 2 kuisioner didapatkan tingkat keberhasilan masing-masing sebesar 73,69% dan 74,16% dengan kategori baik. Kata kunci : Distribusi Informasi, Telegram, White Box, Skala Likert', '010409041', '011611143', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('9d688cb1', 14030053, 'PENERAPAN CLOUD COMPUTING UNTUK E-LIBRARY DENGAN PEMBATASAN AKSES MELALUI GLOBAL POSITIONING SYSTEM (GPS) DAN IP ADDRESS', 'PENERAPAN CLOUD COMPUTING UNTUK E-LIBRARY DENGAN PEMBATASAN AKSES MELALUI GLOBAL POSITIONING SYSTEM (GPS) DAN IP ADDRESS Oleh Ridho Adi Kurniawan 14030053 INTISARI Perpustakaan adalah tempat dimana dapat mencari dan membaca tentang ilmu yang ada di seluruh dunia. Di beberapa negara, perpustakaan sudah berbentuk website. Di perpustakaan Sekolah Tinggi Teknologi Adisutjipto mempunyai sebuah fasilitas yang diperuntukan mahasiswa untuk mengakses laporan kerja praktik dan laporan tugas akhir.Tetapi fasilitas tersebut terbatas oleh jumlah komputer yang disediakan oleh pihak perpustakaan. Oleh sebab itu perlu ditingkatkan kualitas perpustakaan Sekolah Tinggi Teknologi Adisutjipto dengan membuat website e-library dengan memanfaatkan teknologi cloud computing Selain itu, jika pembaca ingin membuka website ini dengan device masing-masing maka pembaca harus melakukan autentikasi menggunakan lokasi atau IPaddress yang sedang digunakan. Berdasarkan hasil pengujian e-library dapat diakses menggunakan komputer, smartphone, dan laptop yang memiliki plug-in untuk mendukung perangkat lunak untuk akses, dalam hal ini yaitu browser. Pembatasan akses melalui Global Positioning System (GPS) berhasil diterapkan pada e-library, sedangkan pembatasan dengan IP Address dilakukan berdasarkan IP network address yang diterapkan pada wireless access point yang ada di Sekolah Tinggi Teknologi Adisutjipto.Google Drive yang digunakan untuk penerapan cloud computing pada e-library ini hanya bisa digunakan sebagai penyimpan data. Kata kunci : e-library, Cloud Computing, Autentikasi lokasi, Autentikasi jaringan
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('a24dd1b9', 14030048, 'MEDIA PEMBELAJARAN INTERAKTIF 2 DIMENSI SISTEM PENCERNAAN MAKANAN PADA MANUSIA', 'MEDIA PEMBELAJARAN INTERAKTIF 2 DIMENSI SISTEM PENCERNAAN MAKANAN PADA MANUSIA Oleh: Mutiara Septiviani 14030048 INTISARI Pembelajaran sistem pencernaan makanan pada manusia dapat menggunakan teknologi media interaktif. Pembuatan media interaktif menggunakan software Corel Draw dan software Adobe Flash. Aplikasi ini berbasis desktop untuk pembelajaran siswa Sekolah Dasar (SD) kelas 5. Sistem pencernaan pada manusia merupakan serangkaian proses untuk mengubah makanan dengan memecah molekul makanan yang kompleks menjadi sederhana dengan bantuan enzim dan menyerap sari makanan yang dibutuhkan oleh tubuh manusia. Pengujian yang dilakukan ada 3 (tiga) macam antara lain, uji fungsi aplikasi, uji pengguna menggunakan kuisioner dengan responden 10 guru Sekolah Dasar (SD), dan uji dengan menggunakan laptop/komputer spesifikasi yang berbeda. Uji aplikasi menunjukkan bahwa aplikasi ini berjalan sesuai fungsinya. Uji pengguna menunjukkan aplikasi ini termasuk kategori baik dengan perolehan nilai 98%. Kata Kunci : Media Interaktif, Pencernaan Makanan, Desktop.', '010706059', '011210095', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('b29f20e7', 14030055, 'SISTEM PEMANDU PARKIR MOBIL DENGAN SUARA BERBASIS ANDROID MENGGUNAKAN SENSOR ULTRASONIK DAN ARDUINO', 'CAR PARKING GUIDE SYSTEM WITH ANDROID BASED SOUND USING ULTRASONIC SENSORS AND ARDUINO Deltha Adhitama 14030055 Abstract The Android-based parking guide system is a parking system that can be used by the driver of the car as a guide tool with the aim that the application can help reverse parking perfectly. This parking guide application is made for cars that do not yet have parking sensor features. Parking guide application is made using Java and C programming language with software used by Android Studio and arduino IDE software. The implementation of this parking guide application is directly installed in a car that does not have a sensor. Some of the tests performed on the parking guide application are testing on different devices (different smartphones) the parking guide application can run on each device (6 smartphones). Testing the connection time with the condition of the open and closed windshield produces a difference in the connection time, the connection time with the windshield is open faster than the closed car glass. Tests with different time sensors still work during the day and night and can still detect the distance of the object. Testing with corner objects, sensors sometimes detect objects. The sensor does not detect the parking limit because the size of the parking limit is shorter than the sensor. In the user test using the average Likert scale the results obtained were 74.84% Keywords: System parking, Android, Ultrasonic, Arduino UNO', '011210095', '011611144', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('f2d9772d', 14030005, 'PERBANDINGAN KECEPATAN SELF HEALING DATABASE PADA JARINGAN KOMPUTER', 'PERBANDINGAN KECEPATAN SELF HEALING PADA JARINGAN KOMPUTER Arifin Annas Rachmadi 14030005 Intisari Self healing adalah sebuah sistem penyembuhan diri sendiri yang diimplementasikan pada sebuah database yang bertujuan untuk sistem keamanan database. Sistem ini berjalan pada sistem operaasi Linux dan berupa service sehingga tidak akan membebani server. Cara kerja sistem ini yaitu secara otomatis sistem akan membuat database lokal dan akan membandingkan nilai hash antara database lokal dengan database server, jika ada perubahan data maka secara otomatis nilai hash akan berubah lalu sistem akan mendeteksi perubahan dan secara otomatis sistem akan mengembalikan data yang berubah seperti semula dalam waktu yang cepat dan akurat. Pengujian dilakukan dengan menggunakan tiga jaringan yaitu peer to peer, LAN, dan internet dengan perubahan data dari 10 data, 20 data, 30 data, 40 data, 50 data, 60 data, 70 data, 80 data, 90 data, dan 100 data dalam jumlah data 725671 data. Hasil uji coba dilihat dari ukuran data dan nilai hash sebelum ada perubahan dan sesudah proses pengembalian data tidak ada kerusakan data satupun sedangkan dilihat dari kecepatan proses didapat hasil rata-rata kecepatan menggunakan jaringan peer to peer 13.0976 detik, LAN 13.5517 detik, dan internet 32.4127detik. Kata Kunci: Self Healing, Database Server, Keamanan, Service, hash, Peer To Peer, LAN, Internet.', '010409041', '011611143', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('77f81907', 14030034, 'MEDIA PEMBELAJARAN INTERAKTIF PENGENALAN POLA BANGUN DATAR DAN BELAJAR MENGHITUNG JUMLAH BANGUN DATAR (STUDI KASUS : TK ABA SURYA MELATI)', 'MEDIA PEMBELAJARAN INTERAKTIF PENGENALAN POLA BANGUN DATAR DAN BELAJAR MENGHITUNG JUMLAH BANGUN DATAR DI TK ABA SURYA MELATI Disusun oleh : Arry Dwi Setiawan 14030034 INTISARI Media Pembelajaran Interaktif merupakan media yang lebih efektif agar pengguna dapat merasakan belajar yang lebih praktis namun menyenangkan serta merangsang pengguna untuk berkeinginan belajar yang kuat. Pola merupakan proses mengenali suatu objek berdasarkan data-data yang sudah ada untuk membedakan macam-macam pola dengan ukuran dan bentuk yang berbeda dari setiap pola yang didapatkan. Tujuan skripsi ini adalah rancangan suatu media pembelajaran yang menarik dan interaktif, khususnya untuk memudahkan anak TK Aba Surya Melati mengenal pola bangun datar dan menghitung bangun datar. Berdasarkan pengujian yang dilakukan, hasil yang diperoleh pada pengujian pengenalan pola 80% dan pada pengujian menghitung bangun datar 65%. Kata kunci : Pola, Menghitung, Media Interaktif, Bangun datar.', '010301030', '011611144', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('c5f5a47c', 14030004, 'MEDIA INTERAKTIF PEMBELAJARAN SEMPOA UNTUK PERHITUNGAN ARITMATIKA ANAK SEKOLAH DASAR KELAS 1 DAN KELAS 2', 'MEDIA INTERAKTIF PEMBELAJARAN SEMPOA UNTUK PERHITUNGAN ARITMATIKA ANAK SEKOLAH DASAR KELAS 1 DAN KELAS 2 Alda Zhakinah Yusuf 14030004 Intisari Saat ini perkembangan di dunia animasi sangat berkembang pesat dan di terapkan di berbagai bidang. Salah satunya di bidang pendidikan, dibutuhkan metode pembejaran yang menarik. Tidak hanya di peroleh dari guru dan buku-buku saja, hal itu akan membuat mereka merasa bosan. Dengan dibuatnya Media Pembelajaran Interaktif dapat menjadi media baru untuk belajar yang seolah-olah bermain game. Pembuatan media interaktif pembelajaran sempoa menggunakan software Adobe Flash CS6. Tujuan media Interaktif Pembelajaran Sempoa untuk dapat dijadikan metode pembelajaran berhitung menggunakan sempoa dengan berinteraksi secara langsung dengan komputer dan dapat menggerakkan atau mengeser-geserkan sempoa yang terdapat di Media Pembelajaran Interaktif tersebut. Dari hasil pengujian yang diuji coba kebeberapa PC, file yang dapat di-play dengan sempurna yaitu file.exe sedangkan file.SWG hanya dapat di-play di PC yang mempunyai Adobe Flash dan hasil uji coba kemudahan dalam menggunakan aplikasi kebeberapa murid SD dengan sebar kuisioner didapatkan hasil 82,4% dari 30 responden yaitu masuk dalam kategori “Sangat Baik” dengan metode perhitungan Skala Likert. Kata kunci : media, interaktif, sempoa, Adobe Flash CS6, dan Skala Likert', '010706059', '010209011', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('f449e4de', 14030054, 'SISTEM KEAMANAN PENDETEKSI UNIFORM RESOURCE LOCATOR (URL) BERBASIS ANDROID', 'SISTEM KEAMANAN PENDETEKSI UNIFORM RESOURCE LOCATOR(URL) BERBASIS ANDROID Eko Murdiansyah 14030054 Intisari Sejalan dengan kemajuan teknologi dan informasi, semakin kompleks pula jenis serangan yang terjadi di dunia maya.Terlepas dari beraneka ragamnya jenis serangan yang ada, secara prinsip terdapa tempat jenis aktivitas yang kerap dikategorisasikan sebagai tindakan cyber crime yaitu interception, interruption, modification, dan fabrication. Penelitian yang dikerjakan adalah bagaimana membangun sebuah aplikasi berbasis Android yang mampu mendeteksi keamanan dari sebuah URL.Penelitian dilakukan dengan maksud agar pengguna smartphone Android terhindar dari tindak kejahatan cyber crime yang ingin mencuri data-data pribadi. Pembuatan aplikasi menggunakan metode Regular Expression untuk menganalisa setiap baris Webpage Source Codepada URL berdasarkan 8 kriteria yang diambil dari World Wide Web Consortium (W3C). Aplikasi kemudian diuji coba dengan 10 URL bermuatan phishing dan dibandingkan dengan aplikasi Kaspersky, McAfee, dan AdBlock. Berdasarkan hasil uji coba dan perbandingan, aplikasi yang telah dibuat mampu mendeteksi 6 atau 60% dari 10 URL tersebut.Aplikasi Kaspersky dan McAfee mampu mendeteksi 70%, sedangkan AdBlock hanya mendeteksi 3 atau 30% dari 10 URL yang mengandung phishing tersebut. Kata Kunci: Internet, Cyber crime, URL', '010409041', '011409116', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('141c7946', 14030009, 'REMOTE CAMERA PADA SMARTPHONE BERBASIS ANDROID YANG DIPASANG PADA DRONE SYMA X8HG', 'REMOTE CAMERA PADA SMARTPHONE BERBASIS ANDROID YANG DIPASANG PADA DRONE SYMA X8HG Disusun Oleh : Christoporus Galih Pramudito NIM : 14030009 INTISARI Kamera yang ada pada smartphone pada dasarnya untuk mengambil gambar atau video dengan kualitas setara kamera digital atau video recorder. Kamera pada smartphone terletak pada dua lokasi yang berbeda, pertama di tempatkan disisi belakang dan yang kedua berada di depan. Drone Syma x8hg yang digunakan untuk menerbangkan smartphone untuk proses pengambilan gambar yang dikendalikan dari software laptop, jarak jangkauan maksimal 80 meter dari drone dengan remote control. Software pada perangkat Android dan laptop harus terlebih dahulu diinstalisasi agar kedua perangkat dapat terhubung dengan perantara Web server untuk proses pengambilan gambar dari drone syma x8hg, kedua perangkat tersebut harus memiliki koneksi jaringan provider masing-masing. Hasil dari pengujian kamera smartphone yang dibawa terbang oleh drone dapat dikendalikan untuk pengambilan gambarnya dengan jarak dipengaruhi oleh kekuatan signal dari penyedia layanan koneksi internet, sedangkan ketinggiannya sangat terbatas oleh kekuatan signal antara drone dengan remote controlnya. Kata kunci : Drone, Remote Camera, Smartphone Android.
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('a52926b8', 15030065, 'ANIMASI PERFORMA MESIN SPEY Mk. 555-15 PADA TURBOJET ENGINE', 'ANIMASI PERFORMA MESIN SPEY Mk. 555-15 PADA TURBOJET ENGINE Oleh Benny Arian Saputra 15030065 INTISARI Turbojet merupakan engine yang masih banyak digunakan pada pesawat terbang. Pada animasi ini menunjukkan performa mesin SPEY Mk. 555-15, menunjukkan adanya perubahan tekanan suhu udara di turbojet ditunjukkan dengan adanya perubahan warna di combustion chamber dan perubahan percepatan perpuataran kompresor. Dalam animasi performa mesin SPEY Mk. 555-15 menggunakan perhitungan dengan inputan Throttle menghasilkan output berupa nilai Thrust, SFC, N1 dan N2 dimana output tersebut hasil dari perhitungan manual yang diinputkan secara sistem agar mempermudah perhitungannya. Dalam pembuatan animasi ini terdapat beberapa proses, yaitu pembuatan modelling turbojet dengan menggunakan Blender, kemudian dilanjutkan dengan proses animation menggunakan Unity. Berdasarkan hasil pengujian black box didapatkan bahwa Animasi Performa Mesin SPEY Mk. 555-15 Pada Turbojet Engine dapat dijalankan pada sistem operasi Windows 7 (64 bit) Windows 8 (64 bit) dan Windows 10 (64 bit). Dan uji pakar didapatkan hasil bahwa animasi ini dapat membantu dosen dalam menyampaikan materi kuliah, informatif, mudah dimengerti, input dan output sudah sesuai. Dari hasil perhitungan inputan Throttle semakin naik maka output nilai Thrust, N1 dan N2 juga akan naik, tetapi nilai Spesific Fuel Consumption (SFC) akan turun. Kata kunci : mesin Turbojet, Thrust, SFC, N1, N2', '010706059', '011811186', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('4414f092', 14030061, 'PERANCANGAN MEDIA INTERAKTIF SIMULASI 2D CARA KERJA BALING BALING TURBOPROP PADA PESAWAT TERBANG', 'PERANCANGAN MEDIA INTERAKTIF SIMULASI 2D CARA KERJA BALING BALING TURBOPROP PADA PESAWAT TERBANG Oleh Muhamad Asrofi 14030061 INTISARI Turboprop merupakan mesin pesawat terbang yang masih banyak digunakan pada saat ini, pada media interaktif simulasi 2D ini ini menunjukkan performa mesin turboprop menunjukan informasi tentang cara kerja mesin turboprop dengan deskripsi tooltips yang ditunjukkan pada aplikasi Pada media interaktif simulasi 2 dimensi cara kerja mesin turboprop memuat tentang bagaimana mensimulasikan sebuah nilai Thrust, SFC, dan RPM , hasil pengujian black box didapatkan bahwa aplikasi mesin pesawat turboprop dapat dijalankan pada sistem operasi Windows 10 (64) bit. Tetapi aplikasi ini tidak dapat di jalankan pada sistem operasi Windows 7 (32 bit) dan Windows 8 (32 bit), karena animasi ini tidak kompatibel, berdasarkan uji fungsi simulasi bahwa tombol, tooltips dan fungsi simulasi dapat berfungsi dengan baik, hasil dari pengujian dengan 30 mahasiswa sebesar 87.6% dan kuisioner terhadap mahasiswa dinyatakan “Sangat Baik” hasil dari pengujian kuisioner didapatkan hasil bahwa aplikasi ini dapat membantu mahasiswa memahami dalam belajar secara interaktif informatif, input dan output dapat mudah di mengerti, di dalam aplikasi. Kata kunci : Mesin Turboprop, Thrust, SFC, RPM
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('d41645cb', 14030033, 'MEDIA INTERAKTIF PEMBELAJARAN HELIKOPTER BELL-412EP', 'MEDIA INTERAKTIF PEMBELAJARAN HELIKOPTER BELL-412 Oleh : Resti Ardiyanti 14030033 INTISARI Helikopter Bell-412EP merupakan salah satu helikopter di Indonesia yang digunakan untuk pertahanan dengan maksimal kapasitas penumpang dan amunisi untuk perang. Tidak banyak dijelaskan secara detail bagaimana setiap komponen di helikopter berfungsi dan mudah dimengerti, karena biasanya hanya berupa gambar dan menggunakan bahasa yang tidak bisa dimengerti oleh semua orang. Dalam penelitian ini, aplikasi dapat membantu memahami pembelajaran Bell-412EP menggunakan media pembelajaran berbasis animasi interaktif. Dengan aplikasi ini, Peserta dapat mempelajari semua teori umum helikopter Bell-412EP. Metode pembelajaran menggunakan sistem pada deskstop base dalam slide visual menggunakan bahasa Indonesia sehingga peserta dapat menerima pesan teori dengan mudah, Sumber informasi dikompilasi dari data didalam multimedia. Pengujian sistem ini menggunakan uji fungsionalitas yang dilakukan sebanyak 5 kali. Pengujian hasil dari sistem tidak ditemukan kesalahan. Pengujian pengguna dilakukan dengan kuesioner dengan 30 pengguna selama 2 hari berturut-turut dan aplikasi terbukti berjalan dengan baik. Kata Kunci : Helikopter Bell-412, Fungsionalitas, Media Interaktif.', '010706059', '011801166', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('985af815', 14030057, 'SISTEM PENDUKUNG KEPUTUSAN REKOMENDASI PEMILIHAN DOSEN BERPRESTASI DALAM BIDANG PENELITIAN DENGAN METODE PENYARINGAN KOLABORATIF', 'SISTEM PENDUKUNG KEPUTUSAN REKOMENDASI PEMILIHAN DOSEN BERPRESTASI DALAM BIDANG PENELITIAN DENGAN METODE PENYARINGAN KOLABORATIF ReginaMaula Adiba 14030057 INTISARI Intisari Kemajuan pendidikan pada era ini dapat dijadikan tolok ukur kemajuan suatu negara, sehingga pengembangan teknologi melalui penelitian dan inovasi sangat dibutuhkan. Penelitian ini bertujuan untuk mengembangkan sistem pendukung keputusan untuk di Sekolah Tinggi Teknologi Adisutjipto (STTA), yaitu rekomendasi pemilihan dosen berprestasi dalam bidang penelitian menggunakan Penyaringan Kolaboratif adalah memprediksi hasil akhir menggunakan rating yang diberikan pengguna. Berdasar pada hasil pengujian sistem didapatkan kesimpulan bahwa sistem yang dibangun dapat dijadikan solusi untuk membantu memilih dosen yang layak untuk diberi penghargaan sebagai dosen berprestasi dalam bidang penelitian. Kata Kunci: Sistem Pendukung Keputusan, Rekomendasi Dosen Berprestasi, Metode Penyaringan Kolaboratif', '010209011', '010303032', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('134f9d0c', 14030086, 'PENERAPAN SISTEM TERDISTRIBUSI BERBASIS ANDROID PADA APLIKASI PENJURIAN PERTANDINGAN TAEKWONDO', 'PENERAPAN SISTEM TERDISTRIBUSI BERBASIS ANDROID PADA APLIKASI PENJURIAN PERTANDINGAN TAEKWONDO INTISARI Pertandingan taekwondo dipimpin oleh seorang wasit dan tiga juri yang bertugas memberikan nilai kepada atlet yang mendapat poin. Posisi juri-juri ini berada di pinggir arena yang telah ditentukan.Sistem penjurian membutuhkan banyak perangkat seperti joy-stick, in-focus dan sebuah komputer yang masing-masing perangkat harus terhubung satu sama lain dengan menggunakan sebuah wire, cara ini dirasakan kurang efektif dimana posisi kabel yang tidak boleh tersentuh atau terinjak oleh pemain ataupun wasit yang berada pada area pertandingan. Untuk mengatasi hal tersebut perlu dirancang sebuah sistem penjurian yang memanfaatkan Android dengan jaringan wireless untuk mempermudah memberikan poin. Proses penjurian seperti yang diuraikan dapat diperbaiki dengan memanfaatkan teknologi informasi dalam bentuk smartphone Android untuk penjurian dengan menggunakan alat input berupa ponsel Android yang berfungsi untuk memasukan poin yang nantinya akan ditampilkan. Hasil pengujian menunjukkan bahwa Aplikasi hasil perancangan lebih kompatibel dengan peraturan new World Taekwondo Competition Rules & Interpretation 2018 dibandingkan dengan peralatan scoring sebelumnya yang belum dapat digunakan pada peraturan terbaru. Kata Kunci :Scoring System, Android,Taekwondo, Kyorugi', '010303032', '011409116', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('ca5cdfd7', 14030029, 'GAME PUZZLE HURUF HIJAIYAH DENGAN METODE ACAK MAJU DAN ACAK MUNDUR BERBASIS DESKTOP', 'GAME PUZZLE HURUF HIJAIYAH DENGAN METODE ACAK MAJU DAN ACAK MUNDUR BERBASIS DEKSTOP Oleh Septiana Ninda Anisa 14030029 INTISARI Pada era teknologi sekarang ini, permainan atau yang biasa disebut game merupakan salah satu yang berkembang pesat yang menjadi gaya hidup dan selingan dari kebanyakan individu. Salah satu game yang dimainkan adalah Game Puzzle Huruf Hijaiyah dengan metode acak maju dan acak mundur yang memiliki peraturan sederhana dengan cara seseorang pemain harus berhasil menebak gambar yang sama dengan kemampuan daya ingat yang dimiliki serta timing yang ditentukan agar game lebih menarik. Game ini berjalan berbasis dekstop. Game ini dibagi menjadi 3 kategori berdasarkan umur yaitu umur 4-5 tahun, 6-7 tahun dan 8-10 tahun. memiliki tiga tingkat kesulitan yang terdiri dari level 1, level 2, dan level 3. Hasil persentase dari uji pengguna dengan 10 pertanyaan terhadap 30 responden sebesar adalah 83,32 % dengan demikian termasuk kategori Sangat baik sehingga mudah digunakan untuk pembelajaran pengenalan dasar huruf hijaiyah. Kata kunci : Game puzzle Huruf Hijaiyah, Game', '010706059', '0196305061990032001', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('a913ef3c', 14030017, 'PERBANDINGAN TEOREMA BAYES DENGAN CERTAINTY FACTOR PADA SISTEM PAKAR UNTUK MENGIDENTIFIKASI HAMA UBI JALAR BERBASIS WEB', 'PERBANDINGAN TEOREMA BAYES DENGAN CERTAINTY FACTOR PADA SISTEM PAKAR UNTUK MENGIDENTIFIKASI HAMA UBI JALAR BERBASIS WEB Oleh Shanti Dwi Prasetyawati 14030017 INTISARI Ubi jalar (Ipomea batatas (L) Lamb) merupakan salah satu tanaman umbi-umbian penghasil karbohidrat yang menyimpan umbinya didalam tanah. Proses penanaman ubi jalar memiliki kendala seperti hama yang menyerang ubi jalar, hal ini menjadi masalah bagi petani ubi jalar dikarenakan kurangnya pengetahuan petani terhadap pengendalian hama ubi jalar. Berdasarkan permasalahan yang ada, maka dirancang dan dibangunlah sistem pakar untuk mengidentifikasi hama ubi jalar dengan perbandingan antara Teorema Bayes dan Certainty Factor. Proses identifikasi hama ubi jalar dilakukan dengan memasukkan gejala yang dialami ubi jalar dan selanjutnya gejala tersebut diolah oleh sistem dengan metode Teorema Bayes dan Certainty Factor. Metode Teorema Bayes dan Certainty Factor menghasilkan nilai perhitungan dari tiap hama dan diambil nilai yang tertinggi untuk hasil akhir. Berdasarkan pengujian 35 data didapatkan perbandingan hasil antara pakar dengan metode Teorema Bayes sebesar 80%, sedangkan perbandingan hasil antara pakar dengan metode Certainty Factor sebesar 54.28%. Kata kunci : Sistem Pakar, Hama Ubi Jalar, Teorema Bayes, Certainty Factor', '011611144', '010301030', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('7c3f2ce6', 14030039, 'SISTEM PENDUKUNG KEPUTUSAN UNTUK PENYAPIHAN KELINCI REX DENGAN METODE SIMPLE ADDITIVE WEIGHTING (SAW)', 'SISTEM PENDUKUNG KEPUTUSAN UNTUK PENYAPIHAN KELINCI REX DENGAN METODE SIMPLE ADDITIVE WEIGHTING (SAW) Fachrul Ardianyah 14030039 Intisari Penyapihan anakan kelinci adalah salah satu kunci sukses dalam berternak atau budidaya kelinci. Penyapihan yang kurang tepat dapat mengakibatkan resiko kematian atau mortalitas yang sangat tinggi, sedangkan penyapihan terlalu lama mengakibatkan menurunnya produktifitas dan dapat terjadinya perkawinan anak dengan induk kelinci. Penelitian yang dikerjakan adalah merancang dan membangun aplikasi Sistem Pendukung Keputusan (SPK) dengan metode Simple Additive Weighting (SAW) dengan 5 kriteria sebagai penunjang SPK perhitungan yaitu berat badan (gram), panjang badan (cm), masih menyusui atau tidak, sudah mandiri mencari makan atau tidak dan jenis kelamin. Aplikasi SPK yang dibuat diuji cobakan dengan perhitungan sistem dibandingkan dengan data. Berdasarkan data yang diuji cobakan sejumlah 36 anakan yang berasal dari penelitian sebelumnya hasil yang didapatkan menunjukan bahwa aplikasi SPK yang dibangun 100% sama hasilnya. Kata Kunci : Sistem Pendukung Keputusan, Kelinci REX, Web, SAW', '011611144', '010409041', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('b0d600b8', 14030058, ' VISUALISASI TIGA DIMENSI BANGUNAN SEKOLAH DASAR AGAPE WONOSOBO DENGAN METODE LOWPOLY', 'VISUALISASI TIGA DIMENSI BANGUNAN SEKOLAH DASAR AGAPE WONOSOBO DENGAN METODE LOWPOLY Bayu Aji Santoso 14030058 Intisari Pembuatan objek 3D bisa menggunakan bermacam software, salah satunya menggunakan software Blender. Adapun metode dalam pembuatan objek 3D antara lain lowpoy dan highpoly. Visualisasi merupakan proses penyampaian informasi yang disajikan dalam visual 3D sehingga objek terlihat lebih menarik dan lebih nyata, maka dari itu dibuat visualisasi Bangunan SD Agape Wonosobo yang diharapkan dapat dimanfaatkan oleh pihak yayasan untuk membantu penggambaran bangunan SD Agape yang akan dibangun. Pembuatan objek 3D dalam penelitian ini menggunakan metode lowpoly. Dari hasil pengujian yang dilakukan aplikasi visualisasi 3D dapat membantu memvisualisasikan bangunan SD Agape yang akan dibangun, waktu mengaksesnya berdasarkan Browser yang digunakan paling cepat menggunakan Browser Firefox, sedangkan berdasarkan komputer dengan spesifikasi berbeda waktu aksesnya dipengaruhi dari prosesor dan ram yang tersedia semakin tinggi spesifikasinya semakin cepat waktu aksesnya. Pada aplikasi visualisasi ini tidak bisa dijalankan di Browser yang tidak didukung WebGL. Kata Kunci : Visualisasi, Tiga Dimensi, Lowpoly, Highpoly, WebGL.', '010706059', '011611143', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('77v79863', 14030022, 'PENGIRIMAN DATA KOORDINAT GLOBAL POSITION SYSTEM (GPS) PADA DRONE DENGAN MEMANFAATKAN JARINGAN INTERNET', 'PENGIRIMAN DATA KOORDINAT GLOBAL POSITION SYSTEM (GPS) PADA DRONE DENGAN MEMANFAATKAN JARINGAN INTERNET Disusun Oleh : Reza Aditya NIM : 14030022 INTISARI Drone merupakan salah satu teknologi canggih yang berupa kendaraan udara. Bentuknya tersebut menyerupai pesawat terbang atau helikopter yang dapat dikendalikan oleh remote control. Drone yang dikendalikan menggunakan remote memiliki keterbatasan sinyal. Sinyal yang digunakan bersumber dari jaringan WI-FI sehingga jarak jangkauan terbang drone terbatas. Layanan internet dari provider telekomunikasi belum bisa dimanfaatkan oleh drone karena fasilitas pada drone belum bisa terhubung pada jaringan tersebut. Agar data GPS dapat diambil dan dikirimkan melalui jaringan internet maka pada penelitian ini drone akan menerbangkan smartphone yang memiliki fasilitas GPS yang digunakan untuk mengirimkan data ke web server dan menampilkannya pada web. Hasil penelitian menunjukan bahwa titik koordinat atau lokasi pada smartphone yang diterbangkan oleh drone berhasil mengirimkan data latitude dan longitude melalui jaringan internet dan menampilkannya dalam bentuk Maps pada web. Kata kunci : Drone, Remote, Global Position System (Gps), Lokasi, Maps, Koordinat, Jaringan Internet', '010303032', '011210095', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('5249cd89', 14030068, 'DISKUSI ONLINE DENGAN METODE VIRTUAL CLASSROOM SEBAGAI PENUNJANG PERKULIAHAN SIMULATOR DIGITAL PESAWAT TERBANG DI STTA YOGYAKARTA', 'DISKUSI ONLINE DENGAN METODE VIRTUAL CLASSROOM SEBAGAI PENUNJANG PERKULIAHAN SIMULATOR DIGITAL PESAWAT TERBANG DI STTA YOGYAKARTA Oleh Awandha Prabowo 14030068 INTISARI E-Learning adalah suatu sistem atau konsep pendidikan yang memanfaatkan teknologi informasi dalam proses belajar mengajar dengan menggunakan media elektronik. Biasanya digunakan untuk proses belajar mengajar dalam jarak yang tidak terbatas. Pada proses pembelajaran mata kuliah Simulator Digital Pesawat Terbang dengan menggunakan e-learning di STTA Yogyakarta terdapat beberapa kendala yaitu tampilan yang tidak mudah untuk dipahami dan tidak ada fasilitas diskusi pada bagian materi. Berdasarkan hal tersebut, e-learning dengan metode virtual classroom ini diharapkan dapat mengatasi permasalahan tersebut sehingga proses pembelajaran dapat berjalan dengan baik dan efektif. Pada fitur diskusi online dengan metode virtual classroom ini terdapat dua metode yaitu synchronous dan asynchronous. Berdasarkan pengujian menggunakan white box terhadap 13 path selama 3 hari didapatkan tingkat keberhasilan sebesar 100%. Sedangkan pengujian dengan menggunakan black box didapatkan tingkat keberhasilan sebesar 100% untuk sisi dosen dan 100% untuk sisi mahasiswa diakses menggunakan perangkat laptop dengan sistem operasi Windows 7 dan 8. Sedangkan dengan diakses menggunakan perangkat smartphone Android versi Kitkat, Lollipop, dan Oreo didapatkan tingkat keberhasilan sebesar 80% untuk sisi dosen dan 60% untuk sisi mahasiswa. Berdasarkan hasil pengujian dengan skala Guttman didapatkan tingkat keberhasilan mendekati sesuai dengan persentase 92%. Kata kunci: E-learning, Virtual Classroom, Synchronous, Asynchronous', '011611143', '010706059', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('912d06b7', 14030064, 'ANIMASI 3D RUTE WISATA MENGGUNAKAN BUS TRANS JOGJA BERBASIS ANDROID', 'ANIMASI 3D RUTE WISATA MENGGUNAKAN BUS TRANS JOGJA BERBASIS ANDROID Oleh Fatimatuzzahroh 14030064 Intisari Animasi 3D merupakan penciptaan gambar bergerak dalam ruang digital 3 dimensi. Konsep animasi 3D sendiri adalah sebuah model yang memiliki bentuk, volume, dan ruang. Animasi 3D sendiri banyak dimanfaatkan dalam berbagai kebutuhan, salah satu penerapannya animasi 3D tersebut bisa digunakan sebagai media informasi rute wisata yang berbasis Android. Penggunaan Android dalam mengakses informasi rute wisata sendiri bisa dianggap lebih efisien karena pada zaman sekarang ini sudah banyak orang yang menggunakan android. Pembuatan media interaktif menggunakan software Blender dan software Construct 2. Desain tersebut kemudian diimplementasikan dalam bentuk video animasi. Banyaknya tempat wisata yang ada di Yogyakarta menjadikan para wisatawan tertarik untuk berwisata di Yogyakarta, sedangkan untuk menuju tempat-tempat wisata tersebut dapat dijangkau dengan menggunakan transportasi umum salah satunya menggunakan bus trans Jogja. Rute wisata sendiri bisa dijadikan sebagai media informasi yang dapat membantu wisatawan yang akan melakukan perjalanan wisata di daerah Yogyakarta. Hasil uji coba menunjukkan bahwa aplikasi berjalan dengan baik dan hanya dapat digunakan pada Android dengan versi minimal RAM 1 MB, tombol pada aplikasi dapat digunakan, rute yang ditunjukkan sesuai dengan peta konvensional. Kata Kunci : Media Interaktif, Rute Wisata, Animasi 3D', '010706059', '011210095', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('d3658bf8', 14030070, 'PENGARUH KOMPRESI FAST FORWARD MOTION PICTURE EXPERT GROUP (FFMPEG) TERHADAP KUALITAS VIDEO', 'PENGARUH KOMPRESI FAST FORWARD MOTION PICTURE EXPERT GROUP (FFMPEG) TERHADAP KUALITAS VIDEO Oleh Afrizal Triantoro 14030070 INTISARI Kompresi video pada umumnya hanya melakukan kompresi pada file video saja tanpa melakukan kompresi terhadap file audio didalamnya, hal ini mengakibatkan proses kompresi menjadi tidak maksimal. Pada penelitian ini proses kompresi dilakukan terhadap file video dan audio yang terdapat didalamnya agar mendapatkan hasil kompresi yang maksimal. Web kompresi video ini memanfaatkan perangkat lunak FFmpeg untuk melakukan proses kompresi dengan memecah video asli yang memliki resolusi 720 menjadi 4 resolusi file yaitu 720, 480, 360, dan 240. Pengujian dilakukan dengan membandingkan hasil kompresi terhadap file video saja dan kompresi terhadap video dan audio dan terdapat perbedaan ukuran file 1-2Mb dengan kecepatan kompresi yang beragam. Selain melakukan pengujian tersebut juga dilakukan pengujian kompresi pada perangkat yang berbeda dan didapat hasil yang relatif sama pada semua perangkat. Pengujian kualitas gambar pada file hasil kompresi didapat hasil kualitas gambar pada video hasil kompresi dibawah standar 30dB. Kata kunci : Web, Kompresi Video, FFmpeg.', '010409041', '011611144', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('3827c5b5', 14030065, 'PENERAPAN ALGORITMA LIPAT PADA ANDROID GUNA MENGAMANKAN KOMUNIKASI DATA DI MEDIA SOSIAL', 'PENERAPAN ALGORITMA LIPAT PADA ANDROID GUNA MENGAMANKAN KOMUNIKASI DATA DI MEDIA SOSIAL Oleh Muhammad Imam 14030065 INTISARI Kriptografi adalah salah satu ilmu yang yang mempelajari tentang pengamanan sebuah pesan. Pengamanan pesan dilakukan dengan cara mengacak pesan (enkripsi) dan dikembalikan lagi kebentuk aslinya (deskripsi). Pada penelitian ini, terlebih dahulu dilakukan perancang sistem dan membangun sebuah aplikasi untuk mengamankan pesan dengan menggunakan metode Algoritma Lipat yang bertujuan untuk mengamankan pesan yang terdiri dari huruf, angka, atau simbol. Aplikasi yang dirancang dan dibangun berjalan di Mobile Android. Metode Algoritma Lipat menerapkan sistem kelipatan empat dalam proses enkripsi dan deskripsi yaitu pesan yang akan di enkripsi dan di deskripsi akan dimajukan 4 (empat) karakter kedepan atau kebelakang. Berdasarkan pengujian yang dilakukan aplikasi berhasil melakukan proses enkripsi dan deskripsi dengan benar, mulai dari pesan singkat sampai dengan pesan sebanyak 2305 karakter. Kata kunci : Kriptografi, Algoritma Lipat, Aplikasi Mobile Android', '010303032', '011611144', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('e47cf1bf', 14030060, 'APLIKASI GAME MOTOR MABUR 3D MENGGUNAKAN METODE GAME LOGIC PADA BLENDER 3D BERBASIS DESKTOP', 'APLIKASI GAME MOTOR MABUR 3D MENGGUNAKAN METODE GAME LOGIC PADA BLENDER 3D BERBASIS DESKTOP Bayu Dwi Atmojo 14030060 Intisari Saat ini pemodelan 3D sudah sangat berkembang dan banyak diterapkan pada berbagai bidang industri, salah satu teknik pemodelannya adalah dengan teknik polygonal yang bisa diterapkan untuk game dengan grafis 3D. Game yang saat ini masih dianggap sebagian orang sebagai media hiburan semata bisa dimanfaatkan menjadi media hiburan untuk melatih ketangkasan dengan menjadikanya game yang interaktif dengan visual yang baik. Pembuatan model 3D helikopter bertujuan untuk menghasilkan model helikopter yang bisa diterapkan pada game “Motor Mabur”. Dari hasil pengujian game “Motor Mabur” dengan menggunakan perangkat desktop menunjukkan penggunaan cpu sebelum full screen lebih besar dibanding sesudah full screen sedangkan penggunaan memori lebih kecil pada saat sebelum full screen, dan untuk hasil pengujian game yang di-upload di situs game itch.io, mendapatkan jumlah views 84, download 30, rating 4, collections 1, comment 10, impressions 110 dan ctr 0.91 %. Kata Kunci: Game Motor Mabur, Polygonal, Grafis 3D, Game Interaktif
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('3b2eb257', 16030050, 'ANALISIS KINERJA JARINGAN KOMPUTER BERBASIS SPANNING TREE PROTOCOL (STP) TERHADAP SERANGAN CONFIG BPDU DAN TAKE OVER ROOT BRIDGE MENGGUNAKAN WIRESHARK', 'ANALISIS KINERJA JARINGAN KOMPUTER BERBASIS SPANNING TREE PROTOCOL (STP) TERHADAP SERANGAN CONFIG BPDU DAN TAKE OVER ROOT BRIDGE MENGGUNAKAN WIRESHARK Oleh Eviana Yulianti Saputri 16030050 INTISARI Spanning Tree Protocol (STP) digunakan pada peralatan switch manageable yang menerapkan jalur lebih dari satu untuk hubungan antar switch. Penggunaan jalur tersebut dimaksudkan agar kecepatan perpindahan data antar switch mencapai kecepatan diatas 100 mbps. Pada penelitian ini mempunyai tujuan untuk membantu staff engineer dalam meningkatkan sebuah keamanan jaringan Spanning Tree Protocol (STP). Serta manfaatnya untuk meningkatkan sistem keamanan jaringan Spanning Tree Protocol (STP) dengan menggunakan teknik mitigasi Spanning Tree Protocol dan VLAN trunking. Pada penelitian ini diawali dengan studi pustaka, analisis pemantauan data dan pengambilan data sebelum STP diserang dan setelah diserang menggunakan aplikasi wireshark. Kemudian dilakukan pengujian transfer file PC ke PC dengan aplikasi speed out versi 5.0. Hasil pengujian ini terdapat data sebelum STP diserang, setelah STP diserang dan data antisipasi. Kemudian, dilakukan analisis regresi linier sederhana dengan hasil tidak terdapat hubungan yang signifikan antara time dengan size pada serangan DoS terdapat 48,6% variable time dipengaruhi oleh variabel size, sisanya sebesar 51,4% oleh variabel lainnya, sedangkan serangan root 43,8% variable time dipengaruhi oleh variabel size, sisanya sebesar 56,2% oleh variabel lainnya. Korelasi Karl Pearson DoS dan root terdapat hubungan yang signifikan antara time dan size dengan koefisien korelasi DoS adalah (-0,697) sedangkan root (-0,662), dan uji T dua sampel berpasangan (paired sample t-test) dapat disimpulkan bahwa terdapat perbedaan sebelum STP diserang dan setelah STP diserang. Dapat dilihat dari perbandingan rata-rata sebelum STP diserang dan setelah STP diserang mengalami penurunan rata-rata yang signifikan. Setelah diambil kesimpulan uji T dua sampel berpasangan (paired sample t-test) dilakukan antisipasi mitigasi BPDU guard dan root guard tetapi masih masih bisa diserang, sehingga perlu tahap selanjutnya yaitu VLAN trunking. Selain itu juga terdapat aplikasi website untuk menampilkan data grafik dan tabel. Kata Kunci : Spanning Tree Protocol, wireshark, regresi linier sederhana', '010303032', '010301028', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('b7b5b69d', 16030047, 'KONFIGURASI ROUTING OPEN SHORTEST PATH FIRST (OSPF) SINGLE AREA PADA ROUTER CISCO 2800 BERBASIS WEB', 'KONFIGURASI ROUTING OPEN SHORTEST PATH FIRST (OSPF) SINGLE AREA PADA ROUTER CISCO 2800 BERBASIS WEB Oleh Nella Hasna Nihayah 16030047 INTISARI Pada suatu organisasi atau perusahaan pasti terdapat perangkat router untuk membentuk sebuah komunikasi antar jaringan. RoutingOpen Shortest Path First (OSPF) sangat cocok digunakan pada routeryang terdapat pada organisasi atau perusahaan dalam membentuk sebuah komunikasi antara router lain, dikarenakan dapat membagi jaringan yang besar menjadi beberapa area. Konfigurasi routing OSPF single area pada cisco router 2800 yang masih berbasis command line dan tidak dapat diakses dari jarak jauh, hal ini membuat administrator harus selalu berhadapan langsung dengan perangkat ketika melakukan konfigurasi routing OSPF single area. Konfigurasi routing OSPF single area berbasis Web dibuat dengan tujuan dapat membantu permasalahan pada administrator dalam melakukan konfigurasi routing OSPF single area. Konfigurasi routing OSPF single area berbasis Web memanfaatkan Application Programming Interface (API) Cisco sebagai penghubung antara perangkat Router Cisco 2800 dengan bahasa pemrograman pada konfigurasi routing OSPF single area berbasis Web. Telnet dibuat untuk untuk memberikan kemudahan atau memberikan akses lebih luas kepada administrator dalam mengolah router dari jarak jauh dengan mengunjungi alamat IP dari router yang telah ditentukan pada saat pembuatan Telnet. Hasil dari pengujian terbukti bahwa konfigurasi routing OSPF single area berbasis Web dapat digunakan untuk melakukan konfigurasi dan dapat memudahkan administrator dalam melakukan konfigurasirouting OSPF sngle area. Kata kunci:OSPF single area, telnet, API Cisco, routingOSPF single area berbasis Web', '011611143', '010409041', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('7c539e5f', 16030007, 'ANALISA KETINGGIAN MUKA AIR MENGGUNAKAN STATISTIK DESKRIPTIF DAN INFERENSIAL UNTUK MENJAGA KETERSEDIAAN AIR DI WADUK SERI OP1', 'ANALISA KETINGGIAN MUKA AIR MENGGUNAKAN STATISTIK DESKRIPTIF DAN INFERENSIAL UNTUK MENJAGA KETERSEDIAAN AIR DI WADUK SERI OP1 Oleh: Puja Kurnia Putri 16030007 Intisari Salah satu proses penyiraman tanaman nanas di PT Great Giant Pineapple (GGP) yaitu dengan memanfaatkan waduk sebagai tempat penyimpanan air ketika musim kemarau tiba. Selama ini dalam mengetahui kondisi air waduk, karyawan PT GGP harus terjun kelapangan yang mengakibatkan pekerjaan tidak efisien dalam penempatan waktu yang dikarenakan jarak antara kantor dengan waduk atau sesama waduk sangat jauh. Untuk itu dibuatlah sebuah sistem yang dapat mengukur ketinggian muka air waduk yang dapat membantu karyawan PT GGP dalam menentukan kondisi kapan waduk harus melakukan proses penambahan air jika waduk mengalami kekeringan dan pengurangan air apabila waduk mengalami peluapan. Sistem pengukuran ini berhasil dibangun dan bekerja dengan baik dengan memanfaatkan teknologi Internet of Things (IoT) yang terdiri dari sensor Ultrasonik HC-SR04 dan mikrokontroler ESP32. Hasil penelitian dari analisis ketinggian muka air ini menunjukkan bahwa akurasi data ketinggian muka air antara data manual dengan data IoT sebesar 98,46% dan presisi sebesar 0%. Hasil uji akurasi kecepatan waktu tampil ketinggian muka air waduk antara data kecepatan waktu pada IoT dengan data kecepatan waktu pada website sebesar 88,86%. Data-data yang dihasilkan sistem ini dinyatakan valid dan konsisten sesuai uji validitas dan reliabilitas. Pada analisis statistik inferensial dengan menggunakan uji Independent Sample T-Test menunjukkan bahwa tidak ada perbedaan yang signifikan (nyata) antara data manual dengan data IoT. Kata kunci: Internet of Things (IoT), statistik, web', '011611143', '011210095', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('fd8a65f3', 13030015, 'MEDIA INTERAKTIF PEMBELAJARAN PENGUBAH BAHASA LATIN MENJADI AKSARA JAWA DASAR', 'MEDIA INTERAKTIF PEMBELAJARAN PENGUBAH BAHASA LATIN MENJADI AKSARA JAWA DASAR Muhammad Imam Raharjo 13030015 INTISARI Media interaktif merupakan salah satu media pembelajaran yang sering digunakan dalam penyampaian materi karena dengan menggunakan media interaktif materi yang disampaikan dapat menambah minat belajar para siswa. Salah satu contoh materi yang dapat dikemas dalam aplikasi media interaktif adalah pembelajaran Aksara Jawa yang merupakan suatu peninggalan sejarah dari nenek moyang yang wajib dipelajari dan dijaga. Adanya media interaktif bertujuan agar mempermudah masyarakat umum dalam mempelajari Aksara Jawa. Aplikasi ini berisi materi tentang sejarah, cara baca dan tulis, kuis, serta penerjemah ke Aksara Jawa. Berdasarkan hasil dari pengujian, aplikasi ini berhasil dijalankan pada beberapa versi Windows yaitu Windows7 (RAM 2GB), Windows8 (RAM 2 GB), dan Windows10 (RAM 8 GB) dan tidak dapat dijalanan pada sistem operasi Linux yaitu Ubuntu, dan berdasarkan hasil pengujian dengan seorang pakar menunjukan bahwa isi materi yang disampaikan sudah sesuai dan benar. Kata kunci : Media Interaktif, Aksara Jawa, Media Pembelajaran', '010706059', '010409041', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('76314be8', 16030089, 'KONFIGURASI SPANNING TREE PROTOCOL BERBASIS WEB PADA CISCO CATALYST 2950 DAN 3750 MEMANFAATKAN APPLICATION PROGRAMMING INTERFACE', 'KONFIGURASI SPANNING TREE PROTOCOL BERBASIS WEB PADA CISCO CATALYST 2950 DAN 3750 MEMANFAATKAN APPLICATION PROGRAMMING INTERFACE Oleh Muchammad Nur Ilham Majid 16030089 INTISARI Spanning Tree Protocol (STP) digunakan untuk mencegah terjadinya loop dan broadcast storm apabila terdapat sistem yang redundant pada perangkat jaringan. STP merupakan salah satu teknologi jaringan komputer yang dapat dimanfaatkan dalam pertukaran data atau hubungan dengan perangkat lain.Hal ini dijumpai pada perangkat jaringan switch, contohnya pada perangkat Cisco Catalyst 2950 dan Cisco Catalyst 3750.Akan tetapi dalam mengkonfigurasi STP pada Cisco Catalyst 2950 dan Cisco Catalyst 3750 masih menggunakan command line dan tidak dapat di akses dari mana saja. Oleh karena itu, perlu di buat STP berbasis web yang memiliki tampilan GUI dan dapat di akses dari mana. Dengan memanfaatkan API sebagai penghubung bahasa pemrograman web dengan Cisco Catalyst dan Telnet sebagai pemberi akses lebih luas, akan di buat STP berbasis web yang dapat di akses dari mana saja dan dengan menggunakan perangkat apa saja yang memiliki web browser. STP berbasis web ini nantinya akan digunakan untuk management dan monitoringSpanning Tree Protocol pada Cisco Catalyst 2950 dan Cisco Catalyst 3750. Hasil pengujian pada penelitian ini menunjukan bahwa STP berbasis web dapat melakukan semua fungsi dan perintah sesuai yang ada di command line, sehingga dapat melakukan konfigurasi Spanning Tree Protocol. Kata kunci : Spanning Tree Protocol , Cisco Catalyst, API, Telnet.', '010904068', '01181187', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('304e58bd', 16030088, 'ANIMASI PENGENALAN BAGIAN TUMBUHAN DENGAN METODE MULTIMEDIA DEVELOPMENT LIFE CYCLE (MDLC) (Studi Kasus: SDN GELAM JAYA II Kabupaten Tangerang)', 'ANIMASI PENGENALAN BAGIAN TUMBUHAN DENGAN METODE MULTIMEDIA DEVELOPMENT LIFE CYCLE (MDLC) (Studi Kasus: SDN Gelam Jaya II Kabupaten Tangerang) Oleh Rilla Wahyuningsih 16030088 INTISARI Pada pembelajaran mengenal bagian tumbuhan dibutuhkan inovasi pembelajaran dengan metode dan media yang baru agar dapat meningkatkan keberhasilan dalam mempelajari materi Ilmu Pengetahuan Alam dengan sub tema mengenal tumbuhan (akar, batang, daun dan bunga) bagi siswa kelas IV SDN Gelam Jaya II. Hal ini dikarenakan metode yang umum digunakan pada sekolah ini masih menggunakan metode teks buku yang minim akan ilustrasi sehingga siswa kurang aktif dan mudah cepat jenuh dengan materi yang di jelaskan di dalam kelas. Berdasarkan masalah tersebut dibangun sebuah animasi pengenalan bagian tumbuhan berbasis desktop yang diharapkan dapat mendukung proses pembelajaran. Penelitian animasi pengenalan bagian tumbuhan ini diolah dengan software adobe photoshop, 3ds max, adobe premiere pro, dan adobe flash professional cs6 dengan metode Multimedia Development Life Cycle (MDLC) terdapat enam tahapan yaitu: concept (pengonsepan), design (perancangan), material collecting (pengumpulan bahan), assembly (pembuatan), testing (pengujian), dan distribution (pendistribusian). Pengujian animasi pengenalan bagian tumbuhan ini meliputi uji fungsionalitas menggunakan metode black box test dengan uji kelayakan oleh para guru sebagai proses validasi dan verifikasi mengenai kriteria penilaian. Hasil dari uji fungsionalitas menyatakan bahwa semua fungsi dan button yang ada pada animasi pengenalan bagian tumbuhan dapat berjalan dengan baik sesuai dengan fungsinya. Hasil dari uji kelayakan oleh para guru diperoleh nilai rata-rata persentase 89,33% termasuk dalam kategori “Sangat Bagus”. Berdasarkan hasil dari serangkaian uji fungsionalitas menggunakan metode black box test dengan uji kelayakan oleh para guru maka metode multimedia interaktif animasi pengenalan bagian tumbuhan dengan metode multimedia development life cycle (MDLC) layak digunakan dalam pembelajaran Ilmu Pengetahuan Alam dengan sub tema mengenal tumbuhan. Kata Kunci: Multimedia Interaktif, Ilmu Pengetahuan Alam, Tumbuhan (Akar, Batang, Daun, Bunga), Multimedia Development Life Cycle (MDLC).', '010301030', '0196305061990032001', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('21f5234f', 16030017, 'STATIC DAN ROUTING INFORMATION PROTOCOL (RIP) BERBASIS WEB PADA CISCO ROUTER 2800 SERIES MEMANFAATKAN APPLICATION PROGRAMMING INTERFACE (API) DARI CISCO', 'STATIC DAN ROUTING INFORMATION PROTOCOL (RIP) BERBASIS WEB PADA CISCO ROUTER 2800 SERIES MEMANFAATKAN APPLICATION PROGRAMMING INTERFACE (API) DARI CISCO Oleh Ega Ari Wiyasa 16030017 INTISARI Pada saat ini routing merupakan teknologi yang banyak dibutuhkan. Hal ini dikarenakan routing pada sebuah router dapat menghubungkan jaringan yang berbeda. Routing dapat melakukan management jaringan yang akan terhubung dengan jaringan lainnya. Cisco Router type 2800 series merupakan router yang dapat dilakukan static routing ataupun dynamic routing. Akan tetapi permasalahan yang ditemukan pada Cisco router type 2800 series yaitu tidak ada aplikasi berbasis Graphics User Interface (GUI) untuk dapat melakukan konfigurasi pada router. Selama ini untuk dapat melakukan konfigurasi pada Cisco router type 2800 series yaitu dengan menggunakan command line. Untuk itu dibuat aplikasi berbasis web untuk mempermudah administrator dalam melakukan konfigurasi pada router. Aplikasi ini memanfaatkan API dari Cisco untuk menghubungkan antara aplikasi berbasis web dengan router. Dengan menggunakan aplikasi berbasis web, seorang administrator dapat melakukan monitoring dan manajemen jaringan secara cepat, tepat dan mampu meminimalisir kesalahan yang akan terjadi. Aplikasi berbasis web memiliki nilai efektivitas sebesar 85,4% lebih baik. Hal ini membuktikan bahwa aplikasi berbasis web dapat mempermudah seorang administrator dalam melakukan routing. Kata kunci : Routing, API Cisco, Telnet, Port Fowarding, Cisco Router Type 2800 Series.
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('f2fb1f47', 16030071, 'KONFIGURASI STATIC DAN DYNAMIC ROUTING PADA MULTILAYER SWITCH (MLS) CATALYST 3750 BERBASIS WEB', 'KONFIGURASI STATIC DAN DYNAMIC ROUTING PADA MULTILAYER SWITCH (MLS) CATALYST 3750 BERBASIS WEB Oleh Yesi Wulandari 16030071 INTISARI Routing Information Protocol (RIP) dan Static routing merupakan salah satu teknologi yang ada pada switch multilayer Cisco Catalyst 3750. Teknologi RIP atau Static routing pada switch multilayer Cisco Catalyst 3750 dapat menghubungkan jaringan yang berbeda antara port satu dengan yang lainnya. Permasalahan yang ditemukan pada Cisco Catalyst 3750 adalah konfigurasi RIP atau static routing masih menggunakan command line melalui console ataupun dengan menggunakan Telnet. Oleh karena dibuat aplikasi berbasis web dan dapat diakses dari jarak jauh. Aplikasi dibuat dengan tujuan untuk memberikan kebebasan administrator dalam melakukan konfigurasi routing pada switch. Pada aplikasi ini, memanfaatkan Application Proramming Interface (API) dari Cisco untuk menghubungkan antara aplikasi berbasis web dengan switch multilayer Cisco Catalyst 3750. Untuk dapat menggunakan aplikasi dari jarak jauh dengan menggunakan Ngrok sebagai penyedia layanan port fowarding. Hasil pengujian pada penelitian ini menunjukkan bahwa aplikasi berbasis Web dapat melakukan konfigurasi pada Cisco Catalyst 3750 sehingga dapat digunakan untuk mengatur hubungan antar komputer dengan menggunakan dynamic atau static routing. Kata kunci : Routing, API Cisco, Telnet, Port Fowarding, Cisco catalyst 3750.', '010904068', '010706059', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('66afd4f0', 13030036, 'PEMANFAATAN STEGANOGRAFI UNTUK PEMBERIAN TANDA KEPEMILIKAN FILE DIGITAL MENGGUNAKAN LEAST SIGNIFICANT BIT (LSB)', 'PEMANFAATAN STEGANOGRAFI UNTUK PEMBERIAN TANDA KEPEMILIKAN FILE DIGITAL MENGGUNAKAN LEAST SIGNIFICANT BIT (LSB) Oleh Lukman Mandala Putra 13030036 INTISARI Tugas akhir ini membahas tentang Steganografi yang kemudian akan diimplementasikan ke sebuah bahasa pemrograman yaitu Java untuk dijadikan sebagai sebuah aplikasi yang berguna sebagai pengamanan data. Metode yang digunakan dalam aplikasi ini adalah Metode LSB (Least Significant Bit). Metode ini merupakan metode yang umum digunakan dalam sebuah aplikasi Steganografi. Pesan yang ingin dilindungi akan disisipkan ke dalam sebuah gambar/Cover Image, audio, atau video. Hasil penelitian ini didapatkan beberapa pengujian yaitu, pada pengujian sistem operasi aplikasi ini akan menggunakan Android minimal versi Gingerbread dengan API level 2.3, sedangkan pada pengujian fungsi aplikasi berjalan dengan baik pada semua media pengujian, sedangkan pada pengujian file aplikasi hanya file digital saja yang dapat disisipi tanda tangan yaitu file audio, video, dan gambar. Kata Kunci : Steganografi, LSB, Android', '010303032', '010301028', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('85af4688', 16030001, 'SISTEM INFORMASI GEOGRAFIS MAPPING PERTANAHAN BERBASIS WEB GUNA PENDATAAN PERTANAHAN DESA (Studi Kasus: Desa Pengkok, Kecamatan Patuk, Kabupaten Gunungkidul)', 'SISTEM INFORMASI GEOGRAFIS MAPPING PERTANAHAN BERBASIS WEB GUNA PENDATAAN PERTANAHAN DESA (Studi Kasus: Desa Pengkok, Kecamatan Patuk, Kabupaten Gunungkidul) Oleh Muhammad Yusuf Idhza Akbar 16030001 INTISARI Pendataan pertanahan desa berbentuk sistem informasi geografis yang berfokus pada pendataan pertanahan desa diperlukan untuk memudahkan dalam melakukan pendataan mengenai informasi pertanahan yang ada di desa. Seperti desa pengkok yang masih melakukan pendataan secara manual menggunakan peta analog tahun 1994, hal tersebut beresiko terjadinya konflik kepemilikan tanah apabila terjadi salah pencatatan atau hilangnya cetakan peta analog. Oleh karena itu penelitian ini bertujuan untuk membangun sistem informasi geografis mapping pertanahan desa pengkok yang terdapat peta digital di dalamnya. Perancangan sistem informasi geografis mapping pertanahan diawali dengan digitasi dengan menggunakan aplikasi ArcMap dari ArcGIS. Untuk melakukan digitasi dilakukan beberapa tahap, mulai dari melakukan scanning peta analog hingga menjadi polygon peta desa pengkok. Implementasi tampilan sistem menggunakan library leaflet sehingga peta digital dan informasi peta dapat muncul di dalam sistem. Sistem diuji dengan menggunakan 2 pengujian, uji akurasi dan uji kesesuaian hasil. Dalam uji akurasi, dilakukan perbandingan antara luas peta di aplikasi dengan luas peta di Google maps dan Catatan Desa Pengkok. Sedangkan uji kesesuaian hasil, dilakukan perbandingan antara data informasi yang tampil didalam sistem dengan data manual. Didapatkan persentase 3,94% uji akurasi dengan google maps dan 4,10% uji akurasi dengan catatan desa pengkok. Sedangkan dalam uji kesesuaian hasil, sistem mendapatkan persentase kesesuaian 100%. Kata Kunci: Digitasi, ArcGIS, Leaflet, Peta Desa', '011210095', '011409116', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('b561bdcd', 13030052, 'PERANCANGAN PERBAIKAN JARINGAN FIBER OPTIC (Studi Kasus : PT. Telkom Akses Area Solo Jawa Tengah)', 'PERANCANGAN PERBAIKAN JARINGAN FIBER OPTIC (Studi Kasus : PT. Telkom Akses Area Solo Jawa Tengah) Oleh: Agung Saputra NIM : 13030052 INTISARI Kebutuhan akan internet yang cepat saat ini perlu didukung dengan infrastruktur yang mumpuni. Penggunaan kabel fiber optik dimaksudkan untuk memenuhi kebutuhan tersebut. Kenyataannya, kabel fiber optik perlu penanganan khusus karena kabel ini terbuat dari kaca. Pada PT. Telkom Akses Area Solo Jawa Tengah, salah satu perbaikan yang dilakukan adalah penyambungan kabel dengan metode fusi yang menghasilkan redaman kecil. Selain itu faktor persiapan dan keselamatan perlu diperhatikan untuk meminimalisir kesalahan saat melakukan penyambungan. Kata Kunci : Fiber optic, Metode Fusi, Internet', '011611143', '011210095', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('46faa8a4', 13030054, 'GENERATE SURAT NOTA DINAS PADA ADMINISTRASI PROGRAM STUDI (PRODI) TEKNIK INFORMATIKA BERBASIS WEB (Studi Kasus Sekolah Tinggi Teknologi Adisutjipto)', 'GENERATE SURAT NOTA DINAS PADA ADMINISTRASI PROGRAM STUDI (PRODI) TEKNIK INFORMATIKA BERBASIS WEB (Studi Kasus Sekolah Tinggi Teknologi Adisutjipto) oleh Nurul Ekawati 13030054 INTISARI Penggunaan surat nota dinas sampai saat ini masih sangat diperlukan untuk keperluan seperti kantor dan instansi. Salah satunya pada administrasi Program Studi Teknik Informatika Sekolah Tinggi Teknologi Adisutjipto Yogyakarta yang masih menggunakan surat nota dinas yang ditulis manual pada Microsoft Word sebagai sarana dalam melakukan komunikasi tertulis untuk menyampaikan informasi kepada pihak yang bersangkutan. Adanya aplikasi generate surat nota dinas untuk mempermudah pengguna (Admin Prodi) dalam pembuatan surat nota dinas. Server yang digunakan pada pembuatan aplikasi generate surat nota dinas ini menggunakan server Apache dengan sistem XAMPP, bahasa pemrograman yang digunakan adalah PHP dengan menggunakan framework Codeigniter dan database MySQL. Aplikasi generate surat nota dinas ini diharapkan dapat mempermudah pengguna dalam pembuatan surat nota dinas. Dengan menggunakan aplikasi ini, pengguna hanya perlu mengisi form tujuan, perihal, dan isi surat saja. Pengguna tidak perlu mengisi tanggal surat karena sudah otomatis sesuai dengan tanggal pembuatan surat, pengguna juga tidak perlu menulis nomor surat ataupun mengatur susunan penulisan surat. Pada pembuatan surat keluar, penomoran surat nota dinas pada aplikasi ini sudah otomatis melanjutkan nomor surat yang terakhir dibuat dan telah terisi pada form nomor surat. Sehingga, pengguna tidak perlu mencari nomor surat nota dinas yang terkahir dan mengisi nomor surat lagi untuk membuat nota dinas yang baru. Kata kunci : Surat nota dinas, generate, web
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('a02141aa', 13030029, 'SISTEM SIMPAN PINJAM BERBASIS WEB PADA KELOMPOK USAHA BERSAMA (KUBE) DI DINAS SOSIAL YOGYAKARTA', 'SISTEM SIMPAN PINJAM BERBASIS WEB PADA KELOMPOK USAHA BERSAMA (KUBE) DI DINAS SOSIAL YOGYAKARTA Oleh Dimas Merianto 13030029 INTISARI Penelitian ini bertujuan untuk menghasilkan program Simpan Pinjam KUBE Berbasis Web yang bisa membantu dan mengembangkan potensi masyarakat terhadap pelaksanaan kegiatan program Kelompok Usaha Bersama KUBE dengan skala wilayah yang luas dalam satu program kegiatan, yang diselengarakan pemerintah, wilayah Daerah Istimewa Yogyakarta.. Sistem simpan pinjam ini diharapkan dapat mengembangkan program KUBE dalam meningkatkan kinerja koperasi itu sendiri, karena sistem ini dirancang dengan tujuan memberi kemudahan dan mengatur keuangan setiap anggota KUBE agar operasional koperasi berjalan lebih efektif dan bisa memberikan pembelajaran mengenai teknologi informasi lebih mudah diperoleh dan dikelola. Kata kunci : Sistem Simpan Pinjam, Koperasi Simpan Pinjam KUBE , XAMPP, PHP MySQL.', '011611143', '011210095', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('3730de40', 13030059, 'MEMBANGUN APLIKASI GAME EDUKASI BERHITUNG UNTUK ANAK KELAS 6 SD BERBASIS ANDROID', 'MEMBANGUN APLIKASI GAME EDUKASI BERHITUNG UNTUK ANAK KELAS 6 SD BERBASIS ANDROID Oleh: Joko Agung Geomerly NIM : 13030059 INTISARI Game edukasi merupakan sebuah permainan yang dibuat dan dirancang dengan tujuan pembelajaran untuk mengajar melalui materi yang diberisikan suara, teks, gambar, video, dan animasi, game edukasi berhitung merupakan bentuk virtual yang dapat dijalankan di device atau perangkat lunak berupa handphone, game tersebut hanya dapat di instal ke os Android versi (ice cream) API 15: Android 4.0.3 hingga ke android versi (Pie) API 28:Android 9.0.0. Game Edukasi Hitung Ceria di uji langsung ke 35 siswa, Hasil uji penulisan data akhir ditetapkan dengan skor dengan batasan 100 (mencapai target) untuk game gelembung jika nilai skor akhir lebih dari 100 akan tetap dihitung 100 dalam waktu 1 menit . dan untuk game Hitung ceria di tetapkan dengan batasan 10=100 jika nilainya lebih dari 10 maka tetap di tulis 10. aplikasi game edukasi untuk perhitungan skor uji aplikasi dengan metode interval yaitu dengan jarak nilai yang di dapat pada skor akhir permainan. Skor akhir dari ke 35 siswa untuk game gelembung dengan total Skor 2834 dan nilai rata-rata 80,97 % yang artinya sangat baik, untuk perhitungan game hitung ceria 10=100 jika siswa 35=3500, maka perhitungan dari game hitung ceria pada hasil uji aplikasi dari 35 siswa dengan total skor 252 dan nilai rata- rata 7,2 % dan dijadikan menjadi 72% dengan artinya baik. Kesimpulanya aplikasi game edukasi hitung ceria bisa dikatakan dapat mempermudah perhitungan aritmatika dan meningkatkan berhitung cepat pada pengguna. Kata kunci: Game edukasi, Android, Interval.', '011210095', '011611143', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('2c17f6a4', 13030061, 'SISTEM PENJADWALAN AWAK CABIN PENERBANGAN SIPIL BERDASARKAN PADA REGULASI KESELAMATAN PENERBANGAN BERBASIS WEB', 'SISTEM PENJADWALAN AWAK CABIN PENERBANGAN SIPIL BERDASARKAN PADA REGULASI KESELAMATAN PENERBANGAN BERBASIS WEB Oleh: Koko Wiyono NIM : 13030061 INTISARI Penjadwalan awak kabin di dalam dunia penerbangan harus dibuat dengan sangat berhati-hati. Dikarenakan dalam pembuatan penjadwalan awak kabin ada beberapa persyaratan yang harus dipenuhi oleh petugas penjadwalan seperti waktu terbang, jam kerja awak kabin dan jam istirahat. Dalam pembuatan penjadwalan tersebut membutuhkan waktu yang lama dikarenakan petugas penjadwalan harus memastikan tugas awak kabin dalam menjalankan tugasnya tidak melebihi atau melanggar persyaratan-persyaratan tersebut. Oleh karena itu dibuatlah sistem penjadawalan awak kabin guna membantu petugas penjadwalan dalam melakukan pembuatan penjadwalan awak kabin menggunakan bahasa PHP dan database oracle. Sistem penjadwalan ini dirancang agar dapat melakukan perhitungan waktu terbang, jam kerja awak kabin dan waktu istirahat awak kabin agar petugas penjadwalan tidak lagi mengalami kesulitan dalam mengsinkronisasi ketika persyaratan tersebut agar petugas awak kabin tidak melanggar ketika persyaratan tersebut hanya dengan 1 langkah proses. Sistem ini berhasil melakukan perhitungan 9 Menit 50 Detik lebih cepat dibandingkan melakukannya dengan cara manual dalam pembuatan 1 rute penerbangan saja. Perbedaan waktu tersebut dapat lebih besar apabila dalam 1 hari penerbangan terdapat lebih dari 1 rute penerbangan. Kata kunci: Penjadwalan Awak Kabin, Awak Kabin, Penerbangan, Keselamatan Penerbangan, PHP.', '010209011', '010706059', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('bc1423ef', 13030067, 'VISUALISASI 3D GEDUNG SEKOLAH TINGGI TEKNOLOGI ADISUTJIPTO BERBASIS TEKNOLOGI AUGMENTED REALITY DI ANDROID', 'VISUALISASI 3D GEDUNG SEKOLAH TINGGI TEKNOLOGI ADISUTJIPTO BERBASIS TEKNOLOGI AUGMENTED REALITY DI ANDROID Oleh Jodio Blasius Lopes 13030067 INTISARI Sekolah Tinggi Teknologi Adisutjipto Yogyakarta dalam mengenalkan informasi kampus yaitu masih menggunakan media cetak dan internet oleh karena itu, diperlukan sebuah aplikasi yang bisa mengenalkan dan memberikan informasi gedung-gedung yang ada di kampus dengan memanfaatkan teknologi Augmented Reality. Dengan adanya teknologi Augmented Reality mampu memberikan informasi secara nyata dan bisa berinteraksi langsung dengan gedung yang ada di kampus. Aplikasi ini dibuat dengan menggunakan aplikasi Unity dan Vuforia. Pembuatan model 3D menggunakan aplikasi Google SketchUp yang kemudian diexport ke aplikasi Unity. Pengujian dilakukan pendeteksian marker terhadap intensitas cahaya, jarak, ukuran marker, dan warna. Dari hasil pengujian marker untuk intensitas cahaya minimal 4 lx dan jarak efektif pendeteksian antara 20 cm sampai 40 cm dan ukuran marker minimal 350 x 350 Pixel, sedangkan pada warna tidak berpengaruh dikarenakan pendeteksian tepi yang menjadi teknik dasar pembacaan marker oleh Vuforia. Aplikasi ini telah berhasil dibuat secara Augmented Reality dalam bentuk visualisasi 3D STTA sebagai media pendukung pengenalan lingkungan Sekolah Tinggi Teknologi Adisutjipto Yogyakarta. Aplikasi ini hanya dapat dijalankan pada smartphone berbasis Android dengan versi minimum 5.0. Kata kunci: Augmented Reality, marker, 3D, visualisasi, AR, android, STTA, adisutjipto
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('7b03319a', 13030070, 'MEDIA EDUKASI KEGIATAN RUTINITAS ANAK (STUDI KASUS: SD N 4 MUHAMMADIYAH BANJARNEGARA)', 'MEDIA EDUKASI KEGIATAN RUTINITAS ANAK (STUDI KASUS: SD N 4 MUHAMMADIYAH BANJARNEGARA) Oleh: Gilar Prakoso NIM : 13030070 INTISARI Game edukasi merupakan sebuah permainan yang dibuat dan dirancang khusus untuk dijadikan sebuah media yang digunakan untuk mengajar orang melalui materi yang berisikan suara, teks, gambar, video, dan animasi, yang pokok materinya membahas suatu subjek tertentu, yang memiliki tujuan untuk dapat memperluas konsep, memberikan pemahaman yang lebih baik dari materi yang mengajarkan sebuah peristiwa sejarah maupun budaya, dan dapat pula mengajarkan pengguna dari game edukasi ini dengan baik, karena mereka dapat bermain sambil belajar dengan mudah. Terlepas dari segala kekurangannya, game merupakan solusi yang tepat dan efisien bagi pendidikan di negeri ini. Terutama bagi anak-anak yang sulit diajak belajar. Hal ini wajar, karena psikologi anak adalah bermain. Mereka lebih banyak belajar ketika bermain Berdasarkan pengujian pada aplikasi, didapatkan hasil uji tampilan GUI dan kepuasan pengguna menghasilkan nilai rata-rata 82,07% dan 82,56%. Sehingga pengujian terhadap aplikasi berdasarkan kuisioner masuk didalam kategori baik, sesuai dengan skala likert yang telah dibuat Kata Kunci : Game, Android, Edukasi
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('f8d09ce0', 13030009, 'SIMULASI PENGKLASIFIKASIAN PESAN PENUMPANG PENERBANGAN MENGGUNAKAN METODE KNN (K-NEAREST NEIGHBOUR)', 'SIMULASI PENGKLASIFIKASIAN PESAN PENUMPANG PENERBANGAN MENGGUNAKAN METODE KNN (K-NEAREST NEIGHBOUR) Oleh: Ragil Andaruwati 130030009 INTISARI Maskapai penerbangan sebagai penyedia jasa angkutan udara kini mulai banyak diminati penduduk di Indonesia. Penumpang sebagai pengguna jasa maskapai penerbangan sering mengalami keluhan. Keluhan ini dikirimkan berupa pesan kepada pihak maskapai penerbangan. Dalam hal ini pesan yang dikirimkan penumpang dikategorikan sebagai keselamatan atau pelayanan maskapai penerbangan. Dalam menentukan pengklasifikasian pesan menggunakan metode KNN (K-Nearest Neighbour) untuk mengetahui sebuah pesan termasuk dalam klasifikasi keselamatan atau pelayanan dengan membandingkan nilai kedekatan kasus baru dengan kasus yang lama atau data sampel. Berdasarkan hasil analisa dari sistem klasifikasi pesan menggunakan metode KNN (K-Nearest Neighbour) dapat membantu dalam menentukan hasil dari sebuah pesan tergolong klasifikasi keselamatan atau klasifikasi pelayanan. Aplikasi klasifikasi pesan ini memberikan hasil akhir yang kurang akurat karena atribut yang terbatas pada sampel sebelumnya. Kata kunci: Klasifikasi, Keselamatan, Pelayanan, KNN (K-Nearest Neighbour)', '010409041', '010209013', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('3bca683c', 13030047, 'PENERAPAN MEDIA PEMBELAJARAN INTERAKTIF PENCEGAHAN PENYALAHGUNAAN NARKOBA', 'PENERAPAN MEDIA PEMBELAJARAN INTERAKTIF PENCEGAHAN PENYALAHGUNAAN NARKOBA Oleh: Ujang Rangga Jatmika NIM : 13030047 INTISARI Penelitian ini bertujuan untuk : (1) mengembangkan media pembelajaran tentang pencegahan penyalahgunaan narkoba, (2) untuk mengetahui kelayakan media pembelajaran interaktif pencegahan penyalahgunaan narkoba. Model pengembangan yang digunakan dalam penelitian ini melalui model pengembangan Multimedia Development Life Cycle (MDLC) dengan melalui enam tahapan. Sumber data yang dikumpulkan berupa data kuantitatif sebagai data pokok dan data kualitatif berupa saran dari responden sebagai data tambahan. Teknik pengumpulan data menggunakan metode angket dengan subyek penelitian siswa kelas X Multimedia. Selanjutnya data yang diperoleh dianalisis dengan menggunakan statistik deskriptif kualitatif. Hasil penelitian yang telah dilakukan diketahui bahwa : (1) Penerapan media tentang pencegahan penyalahgunaan narkoba melalui tahap konsep, perancangan, pengumpulan bahan materi, pembuatan, pengujian dan distribusi, (2) kelayakan media pembelajaran interaktif pencegahan penyalahgunaan narkoba yang dibangun telah teruji Alpha Testing dan Beta Testing. Berdasarkan uji coba responden dan perhitungan skala Guttman, media pembelajaran ini masuk dalam kategori baik dengan rata-rata skor kesesuaian aspek 80% sehingga media pembelajaran ini layak digunakan sebagai bahan materi penyuluhan tentang narkoba terutama ditujukan untuk kalangan remaja. Kata Kunci : Media Pembelajaran Interaktif, Narkoba, Multimedia', '010303032', '011210095', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('e4941a49', 13030031, 'SISTEM PAKAR UNTUK MENDIAGNOSA PENYAKIT KATAK HIJAU DENGAN METODE CERTAINTY FACTOR (CF)', 'SISTEM PAKAR UNTUK MENDIAGNOSA PENYAKIT KATAK HIJAU DENGAN METODE CERTAINTY FACTOR (CF) Oleh Isni Putri Astuti 13030031 INTISARI Katak merupakan salah satu hewan ampibi yang luas penyebarannya mencakup hampir semua negara. Katak mampu hidup kisaran suhu 2-35° celcius.. Banyak katak yang terserang penyakit sehingga menyebabkan panen turun dan mengakibatkan kerugian bagi peternak. Untuk mengatasi masalah tersebut maka perlu diketahuai cara penanganan terhadap penyakit tersebut. Namun kendalanya adalah tidak semua peternak mengetahui jenis dan cara penanganan penyakit yang menyerang ternaknya. Berdasarkan permasalan yang ada maka diusulkan perancangan dan pembangunan aplikasi sistem pakar dengan metode CF yang bisa membantu menjadi sebuah jalan alternatif peternak katak untuk peningkatan pengetahuan terhadap gejala-gejala dan penyakit yang menyerang pada katak. Aplikasi sistem pakar ini dapat dijalankan dengan cara memilih gejala – gejala yang dialamai oleh katak hijau, kemudian sistem pakar akan memberikan informasi terkait nama penyakit serta cara penyembuhannya. Perhitungan Metode Certainty Factor (CF) yaitu nilai CF pada kaidah yang evidencenya dihubungkan oleh operator ‘AND’, maka rumus digunakan dengan mencari nilai terkecil. Hasil pengujian perhitungan manual dengan perhitungan sistem mendapatkan hasil yang sama. Kata Kunci : Sistem Pakar, Certainty Factor, Katak Hijau', '010209011', '010301028', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('817b0f66', 13030042, 'ANALISIS PENGARUH PEMBATASAN AKSES YOUTUBE TERHADAP BANDWIDTH SEKOLAH TINGGI TEKNOLOGI ADISUTJIPTO MENGGUNAKAN METODE UJI STATISTIK', 'ANALISIS PENGARUH PEMBATASAN AKSES YOUTUBE TERHADAP BANDWIDTH SEKOLAH TINGGI TEKNOLOGI ADISUTJIPTO MENGGUNAKAN METODE UJI STATISTIK Oleh: Randy Pratama NIM : 13030042 INTISARI Jaringan internet merupakah suatu kebutuhan yang penting bagi era sekarang. Dalam bidang teknologi jaringan YouTube menggunakan jumlah Bandwidth yang sangat besar dibanding situs informasi yang lain dan tentunya akan mengganggu pengguna lain dalam mengakses Website lain pada aliran internet yang sama. Pada bagian TIK STTA salah satu cara untuk mengurangi jumlah akses YouTube disuatu jaringan dengan membatasi jumlah bandwidth terhadap website YouTube. uji statistika Paired Sample T-test digunakan untuk melihat adakah pengaruh antara sebelum melakukan pembatasan dengan sesudah pembatasan. Hasilnya adalah ada pengaruh antara sebelum pembatasan Bandwidth YouTube dengan sesudah pembatasan Bandwidth YouTube di STTA. Kata Kunci : Bandwidth, Internet, Paired Sample T-Test, Statistika, YouTube.', '011611143', '010409041', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('795cd5e3', 13030041, 'GAME EDUKASI PENGENALAN MAKANAN TRADISIONAL DAERAH BERBASIS ANDROID', 'GAME EDUKASI PENGENALAN MAKANAN TRADISIONAL DAERAH BERBASIS ANDROID Oleh Haryanto Eben 13030041 INTISARI Setiap anak pada zaman sekarang yang kategorinya adalah seorang siswa tahu yang namanya game, kebanyakan dari mereka sangat suka memainkannya baik melalui computer maupun handphone. Kebanyakan dari mereka mengetahui game dapat dijadikan alat untuk refreshing saat suntuk dalam belajar. Namun pada kenyataanya mereka banyak memainkan game-game yang kurang bermanfaat, sehingga dibutuhkan sebuah aplikasi edukasi yang bermanfaat untuk memperkenalkan kebudayaan di Indonesia. penelitian ini akan membahas tentang aplikasi game edukasi untuk memperkenalkan makanan – makanan daerah yang ada di Indonesia, mengingat masakan daerah di Indonesia cukup beragam, sehingga penulis mengangkat tema game edukasi pengenalan masakan tradisional daerah berbasis Android. penelitian ini menghasilkan sebuah aplikasi Android yang mempunyai fungsi sebagai edukasi kepada anak – anak untuk dapat mengenal nama masakan daerah yang cukup beragam. Aplikasi yang dibuat dapat berjalan pada android versi 4.0.3 yaitu Gingerbread atau diatasnya. Kata Kunci : Game Edukasi, Makanan Tradisional, Android
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('61eb960e', 13030050, 'MEDIA INTERAKTIF PEMBELAJARAN TUMBUHAN MONOKOTIL DAN DIKOTIL', 'MEDIA INTERAKTIF PEMBELAJARAN TUMBUHAN MONOKOTIL DAN DIKOTIL Oleh : Melanie Riskiana Sari 13030050 INTISARI Pembelajaran tumbuhan monokotil dan dikotil dapat menggunakan teknologi media interaktif. Media interaktif tersebut dapat mempermudah kegiatan belajar mengajar dan meningkatkan minat belajar. Pembuatan media interaktif menggunakan software Corel Draw dan software Macromedia Flash. Aplikasi ini berbasisi dekstop, sehingga tidak memerlukan koneksi internet. Pengujian yang dilakukan ada tiga macam, antara lain uji fungsi aplikasi, uji pengguna menggunakan kuisioner dengan responden 30 siswa di SDN Potrojayan 2, uji dengan sistem operasi windows. Uji aplikasi menunjukan bahwa aplikasi ini berjalan sesuai fungsinya. Uji pengguna menunjukan aplikasi ini termasuk kategori baik dengan perolehan nilai 80%. Kata Kunci : Monokotil, Dikotil, Media Interaktif, Fungsionalitas.', '010706059', '010301030', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('f0e2dc36', 13030030, 'AIRCRAFT FUEL SIMULATOR UNTUK PENERBANGAN VISUAL FLIGHT RULE (VFR) MENGGUNAKAN RUMUS FLIGHT PLANNING', 'AIRCRAFT FUEL SIMULATOR UNTUK PENERBANGAN VISUAL FLIGHT RULE (VFR) MENGGUNAKAN RUMUS FLIGHT PLANNING Oleh: Ajeng Ryanda Pratika Suhanda NIM : 13030030 INTISARI Perencanaan terbang atau flight planning merupakan sebuah bentuk perencanaan terbang bagi awak cockpit untuk melakukan misi terbang yang akan dilakukannya. Mengacu kepada peraturan – peraturan prencanaan terbang yaitu, Peraturan Keselamatan Penerbangan Sipil ( PKPS), Private Pilot Guidance Handbook FAA Edition perhitungan waktu terbang, Handbook Cessna 172 Section 1 General, Revision 4 dan Civil Aviation Safety Regulation (CASR) Part 121 tentang penerbangan sipil disebutkan bahwa penerbangan dapat dilakukan dengan atau perencanaan terbang, perencanaan terbang terdiri dari perencanaan rute terbang, perencanaan waktu, perencanaan ketinggian, perhitungan waktu terbang dan perhitungan bahan bakar dalam misi terbang. Perencanaan waktu terbang memerlukan perencanaan yang matang dan akurat. Dalam penerbangan visual dan penerbangan latihan bagi siswa penerbang, perencanaan terbang dilakukan dengan cara dan perhitungan manual. Diperlukan model perencanaan dan perhitungan terbang dengan menggunakan sistem berbasis web, sehingga hasil perencanaan yang didapatkan akan lebih cepat dan akurat. Beberapa formula terkait dengan perhitungan ini adalah perhitungan climb, perhitungan cruise dan perhitungan descent. Sistem berbasis web yang dibangun telah dilakukan pengujian dengan hasil uji coba secara keseluruhan bahwa aircraft fuel simulator direkomendasikan karena selisih eror untuk time climb 0,00%, distance climb 0,00%, distance cruise 0,05%, true air speed 0,00%, time cruise 0,06%, time distance 0,05%, distance descent 0,00 %, fuel climb 0,00%, fuel cruise 0,16%, fuel distance 0,00 % trip time 0,05%, dan trip fuel 0,12% masih dalam batas toleransi. Kata Kunci : Web, flight planning, fuel consumption, Visual Flight Rule.', '011801166', '010301028', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('4387bc14', 13030017, 'PERMAINAN GAME 2D BAGI ANAK BERKEBUTUHAN KHUSUS PENYANDANG TUNAWICARA', 'PERMAINAN GAME 2D BAGI ANAK BERKEBUTUHAN KHUSUS PENYANDANG TUNA WICARA Rio Rachmadi Nursa 13030017 Intisari Bagi anak-anak tuna wicara bermain game merupakan salah satu cara agar dapat merasakan kegembiraan yang sama dengan anak normal lainnya, anak yang memiliki keterbatasan seperti tunawicara adalah anak yang menggunakan isyarat dalam berkomunikasi dan berinteraksi satu sama lainnya. Dengan cara itu anak saling berkomunikasi biasanya dengan gerakan tubuh atau tangan yang digunakan untuk berkomunikasi. Pada game Gatotkaca dengan grafis 2D diharapkan dapat mengasah motorik dari anak, dengan dilakukan pengujian secara langsung di SLB Kranamanohara mendapatkan sebuah hasil, waktu yang paling cepat menyelesaikan semua level dengan durasi waktu 09:02,83 Detik, dan durasi waktu terlama dalam menyelesaikan game ini adalah 21:25,06 Detik. pada pengujian ini didapatkan pula usia tertua pada pengujian ini adalah Fajar berjenis kelamin laki-laki berusia 15 Thn 7 Bulan yang berhasil mencapai level 2 Dengan durasi waktu 01:35,18 Detik dan usia termuda pada pengujian ini adalah Riski berjenis kelamin laki-laki berusia 7 Thn 7 Bulan yang berhasil mencapai level 2 Dengan durasi waktu 01:48,15 Detik. Kata Kunci: Game Gatotkaca, Tunawicara, Grafis 2D, SLB Karnamanohara', '010303032', '010904068', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('dfd7c4eb', 13030012, 'PERBANDINGAN METODE BINARY SEARCH DENGAN SEQUENTIAL SEARCH PADA APLIKASI KAMUS BAHASA INDONESIA–SASAK BERBASIS WEB', 'PERBANDINGAN METODE BINARY SEARCH DENGAN SEQUENTIAL SEARCH PADA APLIKASI KAMUS BAHASA INDONESIA - SASAK BERBASIS WEB oleh Eki Fajri Pratama 13030012 INTISARI Cara untuk mempelajari bahasa sangat beragam, ada yang dapat dipelajari di institusi-institusi pendidikan seperti di sekolah ataupun di bangku perkuliahan. Pembelajaran bahasa tentunya akan lebih mudah apabila dapat dilakukan kapan saja dan dimana saja, salah satunya melalui buku kamus. Saat ini sangat jarang ditemui kamus untuk menerjemahkan bahasa Indonesia ke dalam bahasa daerah, dalam hal ini bahasa Sasak. Namun tidak dapat dipungkiri bahwa minat pembaca sangat rendah dikarenakan membaca adalah kegiatan yang kurang praktis untuk dilakukan. Sehingga dibuatlah kamus berbasis web dengan harapan pengguna dapat dengan praktis mencari dan memahami terjemahan kata dengan cara yang mudah tanpa harus membolak-balik lembaran buku. Aplikasi kamus Bahasa Indonesia-Bahasa Sasak berbasis web ini dibuat menggunakan metode binary search. Hasil pengujian pencarian data menghasilkan bahwa running time aplikasi dengan sequential search cenderung mengalami peningkatan dibandingan binary search yang cenderung stabil.Sehingga, pencarian data dengan metode binary search lebih efisien daripada metode sequential search. Kata kunci : binary search, bahasa Sasak, kamus', '011210095', '010904068', 'TF');
INSERT INTO public.tugas_akhir (no_reg, mahasiswa, judul_skripsi, abstrak, dp_satu, dp_dua, ta_prodi) VALUES ('ac09fcd2', 13030008, 'ANALISA SENTIMEN TERHADAP KOMENTAR PENGGUNA MEDIA SOSIAL MENGGUNAKAN METODE STATISTIK PROBABILITAS', 'ANALISA SENTIMEN TERHADAP KOMENTAR PENGGUNA MEDIA SOSIAL MENGGUNAKAN METODE STATISTIK PROBABILITAS Oleh: Firda Aulia 130030008 INTISARI Perkembangan media sosial belakangan membuat media sosial menjadi sarana pemasaran yang terus berkembang. Banyak pihak pengelola e-Commerce yang mengembangkan bisnisnya melalui Onlineshop. Review konsumen pada akun official perusahaan sangat berpengaruh bagi pemasaran dan tingkat penjualan perusahaan. Banyaknya komentar yang ditinggalkan konsumen pada akun official onlineshop membuat pihak perusahaan sulit menarik kesimpulan apakah review konsumen lebih banyak yang positif, negatif atau netral jika mengolahnya secara manual. Oleh sebab itu dibutuhkan sebuah sistem analisis sentimen yang dapat mengklasifikasikan data-data komentar dalam jumlah banyak dan efektifitas waktu dengan menggunakan Metode Statistik Probabilitas. Berdasarkan hasil analisis dari sistem analisis sentimen data komentar media sosial menggunakan metode Statistik Probabilitas dapat membantu dalam menentukan hasil dari sebuah data komentar dan sistem anlisis sentimen yang dibangun juga dapat membantu pengguna baik pihak onlineshop maupun pihak konsumen untuk mengetahui hasil dari analisa sentimen. Kata kunci: Sentimen Analisis, Review, Media Sosial, E-commerce, Statistik Probabilitas.', '011611143', '011409116', 'TF');
